(1, 62, 'Home', 'home', '<h1><strong>Architectural Design Brief</strong></h1>\n<h3>2 Birdie Place Wyong</h3>\n<p>\n    <a href=\"index.php?Itemid=107\">ENTER</a>\n</p>\n', '<!-- {\"name\":\"Home\",\"type\":\"layout\",\"children\":[{\"name\":\"Hero\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"top-center\",\"padding\":\"none\",\"animation_delay\":false,\"image\":\"images\\/banners\\/mercure-kooindah-waters-aerial.jpg\",\"height\":\"full\",\"image_size\":\"cover\",\"header_transparent\":\"light\",\"header_transparent_noplaceholder\":false},\"children\":[{\"name\":\"\",\"type\":\"row\",\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-1\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"type\":\"headline\",\"props\":{\"title_element\":\"h1\",\"content\":\"<strong>Architectural Design Brief<\\/strong>\",\"text_align\":\"center\",\"title_style\":\"heading-large\",\"class\":\"uk-text-uppercase bgm-text-white\",\"margin_remove_bottom\":true}},{\"type\":\"headline\",\"props\":{\"title_element\":\"h3\",\"content\":\"2 Birdie Place Wyong\",\"text_align\":\"center\",\"title_style\":\"h3\",\"class\":\"uk-text-uppercase bgm-text-white\",\"margin_remove_top\":true,\"margin\":\"medium\"}},{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"center\",\"button_size\":\"large\",\"class\":\"bgm-button-white\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"secondary\",\"icon_align\":\"left\",\"content\":\"ENTER\",\"link\":\"index.php?Itemid=107\"}}]}]}]}]}],\"version\":\"2.7.21\"} -->', 1, 2, '2022-03-19 02:05:29', 718, '', '2022-04-19 07:59:10', 718, 0, '0000-00-00 00:00:00', '2022-03-19 02:05:29', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 33, 16, '', '', 1, 363, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(2, 63, 'Concept', 'concept', '<img src=\"/2-birdie-place/images/headers/title-bg-concept.svg\" alt=\"\">\n<div><p>The design and construction of a visually appealing and contemporary home for a mid-50’s married couple with two sons, 16 and 18 years old. We expect both children will no longer be living with us within 3-5 years so the house is primarily being designed and built for adults.</p></div>\n<div><p>The house will be the home we live in as we enter retirement and beyond. It is anticipated that we will see out the remainder of our active lives in this home.</p>\n<p>The project site is situated in a community managed estate within the <a href=\"https://www.mercurekooindahwaters.com.au/\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"Visit the Kooindah Waters website\">Kooindah Waters Golf &amp; Spa Resort</a>. The home’s design, orientation and layout should be such as to take maximum advantage of the eastern aspect of the site which overlooks a natural billabong water course.</p></div>\n<h2>Overall Concept</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<ul>\n        <li>\n\n        \n<div><p>Open plan with abundant natural light</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Passive heating/cooling principles with good cross flow ventilation</div>\n\n    </li>\n        <li>\n\n        \n<div>Seamless integration and flow between indoor/outdoor living spaces</div>\n\n    </li>\n        <li>\n\n        \n<div>Clever and inconspicuous storage and utility spaces</div>\n\n    </li>\n        <li>\n\n        \n<div>Private and secluded with minimal opportunity to see in from street frontages</div>\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/concept/concept-01.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/concept/concept-02.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/concept/concept-03.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/concept/concept-04.jpeg\" alt=\"\">\n\n\n\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=129\">Budget</a>\n</p>\n', '<!-- {\"name\":\"Landing Page\",\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-concept.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Concept Hero\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"large\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_bottom\":false,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-2,1-2\",\"column_gap\":\"large\"},\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>The design and construction of a visually appealing and contemporary home for a mid-50\\u2019s married couple with two sons, 16 and 18 years old. We expect both children will no longer be living with us within 3-5 years so the house is primarily being designed and built for adults.<\\/p>\",\"text_style\":\"lead\",\"maxwidth\":\"2xlarge\",\"maxwidth_breakpoint\":\"l\"}},{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>The house will be the home we live in as we enter retirement and beyond. It is anticipated that we will see out the remainder of our active lives in this home.<\\/p>\\n<p>The project site is situated in a community managed estate within the <a href=\\\"https:\\/\\/www.mercurekooindahwaters.com.au\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" title=\\\"Visit the Kooindah Waters website\\\">Kooindah Waters Golf &amp; Spa Resort<\\/a>. The home\\u2019s design, orientation and layout should be such as to take maximum advantage of the eastern aspect of the site which overlooks a natural billabong water course.<\\/p>\",\"maxwidth\":\"2xlarge\",\"maxwidth_breakpoint\":\"l\"}}]},{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\"},\"children\":[{\"name\":\"Headline\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Overall Concept\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"Modified\",\"type\":\"grid\",\"props\":{\"show_title\":true,\"show_meta\":true,\"show_content\":true,\"show_image\":true,\"show_link\":true,\"grid_default\":\"1\",\"grid_medium\":\"1\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"image_align\":\"top\",\"image_grid_width\":\"1-2\",\"link_text\":\"Visit Page\",\"link_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"fi