(3, 64, 'Kitchen', 'kitchen', '<img src=\"/2-birdie-place/images/headers/title-bg-kitchen.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">The kitchen is an important focus in this project as cooking and preparing food at home is a large part of our daily activity. We use the kitchen as a central hub and meeting point and it’s important it’s the right place to spend time together.</p>\n<p>We often spend many hours preparing large quantities of food. The kitchen needs to provide enough space to accommodate this comfortably without clutter.</p>\n<p>We cook and eat a lot outside throughout the year and would like the kitchen to be “linked” to the garden and flow into the outdoor space, either via fold-away doors opening up directly onto the outdoor kitchen and/or by way of a large servery window with a counter.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Ample storage</div>\n\n    </li>\n        <li>\n\n        \n<div>Plenty of bench/prep space</div>\n\n    </li>\n        <li>\n\n        \n<div>Thick concrete or stone benchtops</div>\n\n    </li>\n        <li>\n\n        \n<div>Large, deep double bowl sink with retractable spray mixer tap</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for large quad door fridge</div>\n\n    </li>\n        <li>\n\n        \n<div>Plumbing to fridge</div>\n\n    </li>\n        <li>\n\n        \n<div><span class=\"highlight\">Induction stove with extraction hob</span></div>\n\n    </li>\n        <li>\n\n        \n<div><span class=\"highlight\">Wall mounted electric oven</span></div>\n\n    </li>\n        <li>\n\n        \n<div>Wall mounted space for microwave oven</div>\n\n    </li>\n        <li>\n\n        \n<div>Dishwasher (split drawer) within arms reach of sink</div>\n\n    </li>\n        <li>\n\n        \n<div>Soft close cupboards, drawers and doors</div>\n\n    </li>\n        <li>\n\n        \n<div>Prefer large pull out drawers/cupboards over deep, under bench cupboards that require you to bend down and are difficult to reach into the back of</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div><p>Large island bench with GPOs at each end</p></div>\n\n    </li>\n        <li>\n\n        \n<div>No clutter/appliances on benches</div>\n\n    </li>\n        <li>\n\n        \n<div>Prefer a single 900mm wall mounted oven</div>\n\n    </li>\n        <li>\n\n        \n<div>Walk in pantry - may be combined with a long bench for appliance use/storage</div>\n\n    </li>\n        <li>\n\n        \n<div>Abundant natural light via windows and/or skylights</div>\n\n    </li>\n        <li>\n\n        \n<div>Practical lighting - no shadows cast over work/prep areas</div>\n\n    </li>\n        <li>\n\n        \n<div>Opens onto outdoor kitchen/BBQ area</div>\n\n    </li>\n        <li>\n\n        \n<div>Dedicated bottle storage rack or cupboard (doesn\'t need to be a visible feature element - will be used to store supermarket purchased soda, quaffing wine etc)</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Butler’s pantry</div>\n\n    </li>\n        <li>\n\n        \n<div>If a 900mm wall oven can\'t be accommodated then twin 600mm wall mounted ovens should be substituted.</div>\n\n    </li>\n    </ul>\n<h2>Dislikes</h2>\n<ul>\n        <li>\n\n        \n<div>Clutter on bench tops</div>\n\n    </li>\n        <li>\n\n        \n<div>Appliances \"on display\" on bench tops</div>\n\n    </li>\n        <li>\n\n        \n<div>Timber near wet areas</div>\n\n    </li>\n        <li>\n\n        \n<div>Grout between tiles used on floors or behind stoves and sinks</div>\n\n    </li>\n        <li>\n\n        \n<div>Lighting that casts shadows over prep areas</div>\n\n    </li>\n        <li>\n\n        \n<div>Cabinetry with gaps between the top and the ceiling. This only provides lots of flat surfaces for dust to settle and serves as a great place for insects to die.</div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/86486-KITCHENTOOUTDOO-MurrayFredericks.jpg\" alt=\"\">\n\n\n<h3>86486 KITCHENTOOUTDOO Murray Fredericks</h3>\n\n\n<div>Nice long bench and workspace. Great ventilation. Like drawers under benches instead of cupboards and storage that extends full height.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/86488--MurrayFredericks.jpg\" alt=\"\">\n\n\n<h3>86488 Murray Fredericks</h3>\n\n\n<div><p>Nice long bench and workspace. Great ventilation. Like drawers under benches instead of cupboards and storage that extends full height.</p>\n<p>Love the 50/50 design of the island bench allowing one end to double as a table with seating on both sides.</p>\n<p>The full height glass looking onto a small private garden provides interesting visual appeal.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/86492-LIVINGROOM-MurrayFredericks.jpg\" alt=\"\">\n\n\n<h3>86492 LIVINGROOM Murray Fredericks</h3>\n\n\n<div><p>Great ventilation ventilation and natural light. Love the louvres used as a design element here. </p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/570w17.webp\" alt=\"\">\n\n\n<h3>570 W 17</h3>\n\n\n<div>Lots of natural light. Big island bench. Overhead cupboards that don\'t have gaps between the top and the ceiling. Like large drawers and handless cupboards.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/570w22.webp\" alt=\"\">\n\n\n<h3>570 W 22</h3>\n\n\n<div>Loads of storage. Like the butler\'s kitchen with plenty of storage and space to keep appliances on the counter but out of everyday sight.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/570w25.webp\" alt=\"\">\n\n\n<h3>570 W 22</h3>\n\n\n<div>Loads of storage. Like the butler\'s kitchen with plenty of storage and space to keep appliances on the counter but out of everyday sight. Don\'t like the open faced overhead cupboards.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2016208714_1_1_200417_041901-w4134-h2760.jpeg\" alt=\"\">\n\n\n<h3>2016208714 1 1 200417 041901 W 4134 H 2760</h3>\n\n\n<div><p>Like cupboards that extend to the ceiling so there are no gaps or flat surfaces for dust and dead insects to settle on. Also like the flush cupboard & drawer faces (no handles).\n\n<p>Skylight and large window over cooking area and workspace provide great natural light.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2016208714_7_1_200409_051936-w4134-h2760.jpeg\" alt=\"\">\n\n\n<h3>2016208714 7 1 200409 051936 W 4134 H 2760</h3>\n\n\n<div>Pantry provides lots of bench space for storing everyday appliances. Like cupboards that extend to the ceiling.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017159753_14_1_210728_064526-w1920-h1280.jpeg\" alt=\"\">\n\n\n<h3>2017159753 14 1 210728 064526 W 1920 H 1280</h3>\n\n\n<div>Good natural light across cooking area. Like no handles on cupboards that extend full height to the ceiling. Like the large, thick, heavyset island bench.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017159753_15_1_210728_064526-w1920-h1280.jpeg\" alt=\"\">\n\n\n<h3>2017159753 15 1 210728 064526 W 1920 H 1280</h3>\n\n\n<div>Good natural light across cooking area. Like no handles on cupboards that extend full height to the ceiling. Like the large, thick, heavyset island bench.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/509w22.webp\" alt=\"\">\n\n\n<h3>509 W 22</h3>\n\n\n<div>Great natural light. Nice big island bench. Like the contrast between the dark and light monochrome colours used.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/227w22.jpeg\" alt=\"\">\n\n\n<h3>227 W 22</h3>\n\n\n<div><p>Like that appliances are hidden away out if view in a scullery or butler\'s pantry</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017523986_7_1_220113_111901-w1024-h682.jpeg\" alt=\"\">\n\n\n<h3>2017523986 7 1 220113 111901 W 1024 H 682</h3>\n\n\n<div>Like the large stone island bench and long cooking area with great natural light over the full length.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017523986_8_1_220113_111901-w1024-h682.jpeg\" alt=\"\">\n\n\n<h3>2017523986 8 1 220113 111901 W 1024 H 682</h3>\n\n\n<div>Like the large stone island bench and long cooking area with great natural light over the full length. Also like the full height, flush mounted cupboards and drawers with no handles and adjoining WIP</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017553212_3_1_220127_075033-w1600-h1067.jpeg\" alt=\"\">\n\n\n<h3>2017553212 3 1 220127 075033 W 1600 H 1067</h3>\n\n\n<div>Like the flush mounted full height cupboards and good lighting above work surfaces.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017553212_4_1_220127_075033-w1600-h1067.jpeg\" alt=\"\">\n\n\n<h3>2017553212 4 1 220127 075033 W 1600 H 1067</h3>\n\n\n<div>Like the flush mounted full height cupboards and good lighting above work surfaces. Also like no handles on the drawers.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017571924_7_1_220204_024655-w4134-h2756.jpeg\" alt=\"\">\n\n\n<h3>2017571924 7 1 220204 024655 W 4134 H 2756</h3>\n\n\n<div>Great flow from one side of the kitchen to the other. Love the transition from inside to out. Nice large, heavy set island bench. Love the butler\'s kitchen / pantry integrated into a hidden room behind the wall mounted ovens and cabinetry.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017649634_9_1_220309_022250-w4600-h3067.jpeg\" alt=\"\">\n\n\n<h3>2017649634 9 1 220309 022250 W 4600 H 3067</h3>\n\n\n<div>Like the large island bench and full height cabinetry. Don\'t like the \"shelf\" below the bench (just another flat surface for dust and insects).</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017649634_10_1_220309_022250-w4600-h3067.jpeg\" alt=\"\">\n\n\n<h3>2017649634 10 1 220309 022250 W 4600 H 3067</h3>\n\n\n<div>Like the handleless cabinetry, large island bench and full height cupboards.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/Jungle_House_4_hfy8ke.jpg\" alt=\"\">\n\n\n<h3>Jungle House 4 Hfy 8 Ke</h3>\n\n\n<div>Lovely long island bench and oodles of natural light. Like the integration of the bookshelves into the bench.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/LAM0065_KITCHEN_300dpi_CMYK_FA_HR_flat_LR-860d30e7-1920w.webp\" alt=\"\">\n\n\n<h3>LAM 0065 KITCHEN 300 Dpi CMYK FA HR Flat LR 860 D 30 E 7 1920 W</h3>\n\n\n<div><p>Like the mixed materials and finishes, heavy set island bench and handless cabinetry.</p>\n<p>Good lighting under overhead cabinets. Also like the sink being inset into the bench.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/MatthewWoodwardArchitecture_WallisLakeHouse_000057_f6ntn3.jpg\" alt=\"\">\n\n\n<h3>Matthew Woodward Architecture Wallis Lake House 000057 F 6 Ntn 3</h3>\n\n\n<div><p>Love the thick concrete bench and the massive flood of natural light from the skylights overhead.</p>\n<p>Like the flush handleless full height cupborads. Don\'t like the open faced overhead cupboards.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/MatthewWoodwardArchitecture_WallisLakeHouse_000007.jpg\" alt=\"\">\n\n\n<h3>Matthew Woodward Architecture Wallis Lake House 000007</h3>\n\n\n<div><p>Love the flow from inside to out. Also love the thick concrete bench and the massive flood of natural light from the skylights overhead. Like the handleless full height cupborads.</p>\n<p>The integration of the herb garden is a nice element but suspect this could become messy and maybe prone to issues with moisture, insects etc. Go on holidays, come home to dried herbs.</p>\n<p>Don\'t like the open faced overhead cupboards.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/88630_1553824147.jpeg\" alt=\"\">\n\n\n<h3>88630 1553824147</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/52Reynolds_12.jpeg\" alt=\"\">\n\n\n<h3>52 Reynolds 12</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/Commercial-Solution-Kitchen-Servery-Aluminum-Bi-Fold-Window.jpeg\" alt=\"\">\n\n\n<h3>Commercial Solution Kitchen Servery Aluminum Bi Fold Window</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/gas-strut.jpeg\" alt=\"\">\n\n\n<h3>Gas Strut</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/NorthRichmond105.webp\" alt=\"\">\n\n\n<h3>North Richmond 105</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/GROUNDFLOOR_01_09109.jpeg\" alt=\"\">\n\n\n<h3>GROUNDFLOOR 01 09109</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/IMG_133209.jpeg\" alt=\"\">\n\n\n<h3>IMG 133209</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/kitchen-bifold-servery-window-dale-alcock-homes-archipelago.jpeg\" alt=\"\">\n\n\n<h3>Kitchen Bifold Servery Window Dale Alcock Homes Archipelago</h3>\n\n\n<div>A servery window could provide a stylish and practical connection to the outdoor kitchen area</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/kitchen/gallery/2017571924_5_1_220204_024655-w4134-h2756.webp\" alt=\"\">\n\n\n<h3>2017571924 5 1 220204 024655 W 4134 H 2756</h3>\n\n\n<div>Love the huge fold-away doors and the great connection this provides between the kitchen, dining, living and outdoor spaces.</div>\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=109\">Materials</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=113\">Dining</a>\n</p>\n', '<!-- {\"name\":\"Case Study\",\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-kitchen.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Hero\"},{\"name\":\"Details\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_bottom\":true,\"animation_delay\":false,\"animation\":\"fade\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"vertical_align\":false},\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"1-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Brief\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"grid\",\"props\":{\"show_titl