 like the kitchen to be \\u201clinked\\u201d to the garden\\u00a0and flow into the outdoor space, either via fold-away doors opening up directly onto the outdoor kitchen and\\/or by way of a large servery window with a counter.<\\/p>\"}}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab essential\",\"attributes\":\"tabtitle=\\\"Essential\\\"\",\"id\":\"essential\",\"padding_remove_top\":false,\"preserve_color\":false,\"overlap\":false},\"children\":[{\"type\":\"row\",\"props\":{\"class\":\"essential\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Essential\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Essential\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"content_style\":null,\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"column\":\"1-2\",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Ample storage\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Plenty of bench\\/prep space\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Thick concrete or stone benchtops\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Large, deep double bowl sink with retractable spray mixer tap\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Space for large quad door fridge\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Plumbing to fridge\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"<span class=\\\"highlight\\\">Induction stove with extraction hob<\\/span>\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"<span class=\\\"highlight\\\">Wall mounted electric oven<\\/span>\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Wall mounted space for microwave oven\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Dishwasher (split drawer) within arms reach of sink\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Soft close cupboards, drawers and doors\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Prefer large pull out drawers\\/cupboards over deep, under bench cupboards that require you to bend down and are difficult to reach into the back of\",\"icon\":\"\",\"icon_color\":\"primary\"}}]}]}]}],\"name\":\"Essential\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab highly-desirable\",\"attributes\":\"tabtitle=\\\"Highly Desirable\\\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Highly Desirable\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Highly Desirable\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"content_style\":null,\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"column\":\"1-2\",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"<p>Large island bench with GPOs at each end<\\/p>\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"No clutter\\/appliances on benches\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Prefer a single 900mm wall mounted oven\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Walk in pantry - may be combined with a long bench for appliance use\\/storage\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Abundant natural light via windows and\\/or skylights\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Practical lighting - no shadows cast over work\\/prep areas\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Opens onto outdoor kitchen\\/BBQ area\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Dedicated bottle storage rack or cupboard (doesn\'t need to be a visible feature element - will be used to store supermarket purchased soda, quaffing wine etc)\",\"icon\":\"\",\"icon_color\":\"primary\"}}]}]}]}],\"name\":\"Highly Desirable\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab desirable\",\"attributes\":\"tabtitle=\\\"Desirable\\\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Desirable\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Desirable\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"content_style\":null,\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Butler\\u2019s pantry\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"If a 900mm wall oven can\'t be accommodated then twin 600mm wall mounted ovens should be substituted.\",\"icon\":\"\",\"icon_color\":\"primary\"}}]}]}],\"props\":{\"width\":\"xsmall\"}}],\"name\":\"Desirable\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab dislikes\",\"attributes\":\"tabtitle=\\\"Dislikes\\\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Dislikes\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Dislikes\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"content_style\":null,\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Clutter on bench tops\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Appliances \\\"on display\\\" on bench tops\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Timber near wet areas\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Grout between tiles used on floors or behind stoves and sinks\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Lighting that casts shadows over prep areas\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Cabinetry with gaps between the top and the ceiling. This only provides lots of flat surfaces for dust to settle and serves as a great place for insects to die.\",\"icon\":\"\",\"icon_color\":\"primary\"}}]}]}],\"props\":{\"width\":\"xsmall\"}}],\"name\":\"Dislikes\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":true,\"padding\":\"small