"text_color\":\"light\",\"overlay_position\":\"center\",\"overlay_transition\":\"fade\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"text_align\":\"center\",\"margin\":\"default\",\"grid_small\":\"3\",\"image_width\":\"640\",\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"overlay_link\":true,\"link_text\":\"\",\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"meta_element\":\"div\",\"link_style\":\"default\",\"item_animation\":true,\"grid_masonry\":true,\"lightbox\":true,\"lightbox_image_orientation\":true,\"title_display\":\"item\",\"grid_parallax\":\"\",\"overlay_transition_background\":false,\"filter\":false},\"children\":[{\"type\":\"gallery_item\",\"props\":{\"title\":\"86486 KITCHENTOOUTDOO Murray Fredericks\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/86486-KITCHENTOOUTDOO-MurrayFredericks.jpg\",\"content\":\"Nice long bench and workspace. Great ventilation. Like drawers under benches instead of cupboards and storage that extends full height.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"86488 Murray Fredericks\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/86488--MurrayFredericks.jpg\",\"content\":\"<p>Nice long bench and workspace. Great ventilation. Like drawers under benches instead of cupboards and storage that extends full height.<\\/p>\\n<p>Love the 50\\/50 design of the island bench allowing\\u00a0one end to double as a table with seating on both sides.<\\/p>\\n<p>The full height glass looking onto a small private garden provides interesting visual appeal.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"86492 LIVINGROOM Murray Fredericks\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/86492-LIVINGROOM-MurrayFredericks.jpg\",\"content\":\"<p>Great ventilation ventilation and natural light. Love the\\u00a0louvres used as a design element here.\\u00a0<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"570 W 17\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/570w17.webp\",\"content\":\"Lots of natural light. Big island bench. Overhead cupboards that don\'t have gaps between the top and the ceiling. Like large drawers and handless cupboards.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"570 W 22\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/570w22.webp\",\"content\":\"Loads of storage. Like the butler\'s kitchen with plenty of storage and space to keep appliances on the counter but out of everyday sight.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"570 W 22\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/570w25.webp\",\"content\":\"Loads of storage. Like the butler\'s kitchen with plenty of storage and space to keep appliances on the counter but out of everyday sight. Don\'t like the open faced overhead cupboards.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2016208714 1 1 200417 041901 W 4134 H 2760\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2016208714_1_1_200417_041901-w4134-h2760.jpeg\",\"content\":\"<p>Like cupboards that extend to the ceiling so there are no gaps or flat surfaces for dust and dead insects to settle on. Also like the flush cupboard & drawer faces (no handles).\\n\\n<p>Skylight and large window over cooking area and workspace provide great natural light.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2016208714 7 1 200409 051936 W 4134 H 2760\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2016208714_7_1_200409_051936-w4134-h2760.jpeg\",\"content\":\"Pantry provides lots of bench space for storing everyday appliances. Like cupboards that extend to the ceiling.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017159753 14 1 210728 064526 W 1920 H 1280\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017159753_14_1_210728_064526-w1920-h1280.jpeg\",\"content\":\"Good natural light across cooking area. Like no handles on cupboards that extend full height to the ceiling. Like the large, thick, heavyset island bench.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017159753 15 1 210728 064526 W 1920 H 1280\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017159753_15_1_210728_064526-w1920-h1280.jpeg\",\"content\":\"Good natural light across cooking area. Like no handles on cupboards that extend full height to the ceiling. Like the large, thick, heavyset island bench.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"509 W 22\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/509w22.webp\",\"content\":\"Great natural light. Nice big island bench. Like the contrast between the dark and light monochrome colours used.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"227 W 22\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/227w22.jpeg\",\"content\":\"<p>Like that appliances are hidden away out if view in a scullery or butler\'s pantry<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017523986 7 1 220113 111901 W 1024 H 682\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017523986_7_1_220113_111901-w1024-h682.jpeg\",\"content\":\"Like the large stone island bench and long cooking area with great natural light over the full length.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017523986 8 1 220113 111901 W 1024 H 682\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017523986_8_1_220113_111901-w1024-h682.jpeg\",\"content\":\"Like the large stone island bench and long cooking area with great natural light over the full length. Also like the full height, flush mounted cupboards and drawers with no handles and adjoining WIP\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017553212 3 1 220127 075033 W 1600 H 1067\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017553212_3_1_220127_075033-w1600-h1067.jpeg\",\"content\":\"Like the flush mounted full height cupboards and good lighting above work surfaces.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017553212 4 1 220127 075033 W 1600 H 1067\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017553212_4_1_220127_075033-w1600-h1067.jpeg\",\"content\":\"Like the flush mounted full height cupboards and good lighting above work surfaces. Also like no handles on the drawers.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017571924 7 1 220204 024655 W 4134 H 2756\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017571924_7_1_220204_024655-w4134-h2756.jpeg\",\"content\":\"Great flow from one side of the kitchen to the other. Love the transition from inside to out. Nice large, heavy set island bench. Love the butler\'s kitchen \\/ pantry integrated into a hidden room behind the wall mounted ovens and cabinetry.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017649634 9 1 220309 022250 W 4600 H 3067\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017649634_9_1_220309_022250-w4600-h3067.jpeg\",\"content\":\"Like the large island bench and full height cabinetry. Don\'t like the \\\"shelf\\\" below the bench (just another flat surface for dust and insects).\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017649634 10 1 220309 022250 W 4600 H 3067\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017649634_10_1_220309_022250-w4600-h3067.jpeg\",\"content\":\"Like the handleless cabinetry, large island bench and full height cupboards.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Jungle House 4 Hfy 8 Ke\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/Jungle_House_4_hfy8ke.jpg\",\"content\":\"Lovely long island bench and oodles of natural light. Like the integration of the bookshelves into the bench.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"LAM 0065 KITCHEN 300 Dpi CMYK FA HR Flat LR 860 D 30 E 7 1920 W\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/LAM0065_KITCHEN_300dpi_CMYK_FA_HR_flat_LR-860d30e7-1920w.webp\",\"content\":\"<p>Like the mixed materials and finishes, heavy set island bench and handless cabinetry.<\\/p>\\n<p>Good lighting under overhead cabinets. Also like the sink being inset into the bench.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Matthew Woodward Architecture Wallis Lake House 000057 F 6 Ntn 3\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/MatthewWoodwardArchitecture_WallisLakeHouse_000057_f6ntn3.jpg\",\"content\":\"<p>Love the thick concrete bench and the massive\\u00a0flood\\u00a0of natural light from the skylights overhead.<\\/p>\\n<p>Like the flush handleless full height cupborads. Don\'t like the open faced overhead cupboards.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Matthew Woodward Architecture Wallis Lake House 000007\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/MatthewWoodwardArchitecture_WallisLakeHouse_000007.jpg\",\"content\":\"<p>Love the flow from inside to out. Also love the thick concrete bench and the massive\\u00a0flood of natural light from the skylights overhead. Like the\\u00a0handleless full height cupborads.<\\/p>\\n<p>The integration of the herb garden is a\\u00a0nice element but suspect this could become messy and maybe prone to issues with moisture, insects etc. Go on holidays, come home to dried herbs.<\\/p>\\n<p>Don\'t like the open faced overhead cupboards.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"88630 1553824147\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/88630_1553824147.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"52 Reynolds 12\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/52Reynolds_12.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Commercial Solution Kitchen Servery Aluminum Bi Fold Window\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/Commercial-Solution-Kitchen-Servery-Aluminum-Bi-Fold-Window.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Gas Strut\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/gas-strut.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"North Richmond 105\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/NorthRichmond105.webp\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"GROUNDFLOOR 01 09109\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/GROUNDFLOOR_01_09109.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"IMG 133209\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/IMG_133209.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Kitchen Bifold Servery Window Dale Alcock Homes Archipelago\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/kitchen-bifold-servery-window-dale-alcock-homes-archipelago.jpeg\",\"content\":\"A servery window could provide a stylish and practical connection to the outdoor kitchen area\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017571924 5 1 220204 024655 W 4134 H 2756\",\"image\":\"images\\/pages\\/brief\\/kitchen\\/gallery\\/2017571924_5_1_220204_024655-w4134-h2756.webp\",\"content\":\"Love the huge fold-away doors and the great connection this provides between the kitchen, dining, living and outdoor spaces.\"}}]}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":false,\"id\":\"pagination\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-2,1-2\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"right\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"left\",\"content\":\"Materials\",\"link\":\"index.php?Itemid=109\",\"icon\":\"chevron-left\"}}],\"name\":\"Previous\"}]},{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"left\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"right\",\"content\":\"Dining\",\"link\":\"index.php?Itemid=113\",\"icon\":\"chevron-right\"}}],\"name\":\"Next\"}]}]}],\"name\":\"Pagination\"}],\"version\":\"2.7.22\"} -->', 1, 2, '2022-03-26 02:24:22', 718, '', '2022-06-26 05:02:07', 718, 0, '0000-00-00 00:00:00', '2022-03-26 02:24:22', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targ