(4, 65, 'Dining', 'dining', '<img src=\"/2-birdie-place/images/headers/title-bg-dining.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">We don\'t have any particular requirements for the dining space other than it be located close by the kitchen and is open-plan.</p>\n<p>It would be nice if the dining space could flow without obstruction into the outdoor area but it\'s not essential.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Near to kitchen</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for 6 seat table</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Space for 8 seat table</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for large (>2m) sideboard credenza (can be built-in)</div>\n\n    </li>\n        <li>\n\n        \n<div>Dining space opens onto the outdoor kitchen/eating area</div>\n\n    </li>\n        <li>\n\n        \n<div>Ceiling fan(s)</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<div>\n\n    \n<div>Space for smaller (<2m) sideboard credenza (can be built-in)</div>\n\n</div>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/509w23.webp\" alt=\"\">\n\n\n<h3>509 W 23</h3>\n\n\n<div>Simple, clean and practical dining space. Like the close proximity to the kitchen and outdoor area. Good natural light.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/509w24.webp\" alt=\"\">\n\n\n<h3>509 W 24</h3>\n\n\n<div>Like the continuation of the kitchen workbench into the dining space. Like the dining being situated next to the kitchen but also that it opens onto the outdoor space.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/509w26.webp\" alt=\"\">\n\n\n<h3>509 W 26</h3>\n\n\n<div>Good flow from the kitchen to the dining space.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/483w2.webp\" alt=\"\">\n\n\n<h3>483 W 2</h3>\n\n\n<div>Great flow from kitchen to dining to outdoors.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/483w8.webp\" alt=\"\">\n\n\n<h3>483 W 8</h3>\n\n\n<div>Great flow from kitchen to dining to outdoors.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/483w12.webp\" alt=\"\">\n\n\n<h3>483 W 12</h3>\n\n\n<div>Great connection between cooking and the two eating spaces.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/bench-feature-panel-wooden-dining-room.webp\" alt=\"\">\n\n\n<h3>Bench Feature Panel Wooden Dining Room</h3>\n\n\n<div>A little bit different and unusual. Like the recessed bench seat and modern Scandinavian aesthetic.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/Uaf1g970Hrk.jpg\" alt=\"\">\n\n\n<h3>Uaf 1 G 970 Hrk</h3>\n\n\n<div>Simple and stylish. Like the dining table is large and close to the kitchen. Nice mid century modern style.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/dining/gallery/opulent+modern+dining+room.webp\" alt=\"\">\n\n\n<h3>Opulent Modern Dining Room</h3>\n\n\n<div>Clean and modern. Like the feature pendant light.</div>\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=112\">Kitchen</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=114\">Living</a>\n</p>\n', '<!-- {\"name\":\"Page - Brief\",\"type\":\"layout\",\"children\":[{\"type\":\"s