reate_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 97, 10, '', '', 1, 627, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(5, 66, 'Living', 'living', '<img src=\"/2-birdie-place/images/headers/title-bg-living.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">We don’t anticipate spending a lot of time in this space and it’s not a priority. It will primarily be used when entertaining. Resale appeal is a consideration so the space needs to work well within the context of the overall design aesthetic.</p>\n<p>Aside from a lounge, one or two single seat chairs, a coffee table and a flat screen TV, we would also like to be able to incorporate a built-in fireplace as the ambience this will provide is very appealing to us.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Lounge suite</div>\n\n    </li>\n        <li>\n\n        \n<div>Coffee table</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for large flat screen TV - either wall mount or freestanding</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Space for 3-4 seater lounge + 2 armchairs</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Inbuilt gas or ethanol fireplace (not freestanding)</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Ceiling fan(s)</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Space for 4 seater lounge</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for one or two side tables</div>\n\n    </li>\n        <li>\n\n        \n<div>Contemporary mantelpiece - could be a nice feature but only if it fits within the overall design aesthetic</div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/Bio-Flame-7222-RC-SMART-Burner.jpeg\" alt=\"\">\n\n\n<h3>Bio Flame 7222 RC SMART Burner</h3>\n\n\n<div>Love the fireplace. Love the mixed materials (brick and marble). Really like the way the external bricks carry through into the living space.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/Churchill-Residence-60-SMART-Burner--scaled.jpeg\" alt=\"\">\n\n\n<h3>Churchill Residence 60 SMART Burner Scaled</h3>\n\n\n<div>Like the fireplace and nothing else!</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/dx1500-frameless-woodland-august-design_2.webp\" alt=\"\">\n\n\n<h3>Dx 1500 Frameless Woodland August Design 2</h3>\n\n\n<div>Like the fireplace, TV above and built-in shelving.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/EcoSmart-Flex_50DB-SBS_Building-AU.jpg\" alt=\"\">\n\n\n<h3>Eco Smart Flex 50 DB SBS Building AU</h3>\n\n\n<div>Like that the living space has been separated into formal and informal using a dividing wall with a double sided fireplace. Also like the use of stone as a feature material.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/EcoSmart-Flex_68BY-Brighton-Au-1_1.jpg\" alt=\"\">\n\n\n<h3>Eco Smart Flex 68 BY Brighton Au 1 1</h3>\n\n\n<div>Sleek and modern look. Lots of natural light with a nice fireplace.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/EcoSmart-Flex_68BY-Brighton-Au-2.jpg\" alt=\"\">\n\n\n<h3>Eco Smart Flex 68 BY Brighton Au 2</h3>\n\n\n<div>Sleek and modern look with a nice fireplace.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/EcoSmart-Flex_68SS-Drummoyne-AU-3.jpg\" alt=\"\">\n\n\n<h3>Eco Smart Flex 68 SS Drummoyne AU 3</h3>\n\n\n<div>Like the recessed lighting above and below.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/exposed-brick-wall-wooden-floors-simplistic-living-room.jpeg\" alt=\"\">\n\n\n<h3>Exposed Brick Wall Wooden Floors Simplistic Living Room</h3>\n\n\n<div>Like the modern joinery and contrast the black provides.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/flex-68by-flex-series-camperdown-au-2.jpg\" alt=\"\">\n\n\n<h3>Flex 68 By Flex Series Camperdown Au 2</h3>\n\n\n<div>Like the fireplace.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/flex-68ss-flex-series-flex-68ss-espace.jpg\" alt=\"\">\n\n\n<h3>Flex 68 Ss Flex Series Flex 68 Ss Espace</h3>\n\n\n<div>Plain and simple but effective.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/xl900-ethanol-burner-pia-ruggeri-xl900-01.jpeg.webp\" alt=\"\">\n\n\n<h3>Xl 900 Ethanol Burner Pia Ruggeri Xl 900 01 Jpeg</h3>\n\n\n<div>Modern look, good natural light.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/Kornacki-Residence-38-Firebox-SS-BLACK-scaled.jpeg\" alt=\"\">\n\n\n<h3>Kornacki Residence 38 Firebox SS BLACK Scaled</h3>\n\n\n<div>Like the firplace with modern mantelpiece.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/rm7-living-and-dining-room-jimmy-and-tam-014_m_df960_1500px_1.webp\" alt=\"\">\n\n\n<h3>Rm 7 Living And Dining Room Jimmy And Tam 014 M Df 960 1500 Px 1</h3>\n\n\n<div>A small living area that works well. Like the way the fireplace and chimney have been subtly highlighted using white slimline bricks. Like the soft natural light as well.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/wala-kooyong-021_with-flames.webp\" alt=\"\">\n\n\n<h3>Wala Kooyong 021 With Flames</h3>\n\n\n<div>Like the use of different materials. Also like the frameless windows.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/wooden-floors-cubby-couch-cosy-living-room.jpeg\" alt=\"\">\n\n\n<h3>Wooden Floors Cubby Couch Cosy Living Room</h3>\n\n\n<div>Modern look... nice.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/xl700-burner-range-barkly-st-mornington.jpg.webp\" alt=\"\">\n\n\n<h3>Xl 700 Burner Range Barkly St Mornington Jpg</h3>\n\n\n<div>Like the way the firplace has been placed between the dining and living spaces.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/armadale5.webp\" alt=\"\">\n\n\n<h3>Armadale 5</h3>\n\n\n<div>Great natural light from the large windows. Nice simple style and of course, a fireplace!</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/rOk4VSMS3Ck.jpg\" alt=\"\">\n\n\n<h3>R Ok 4 VSMS 3 Ck</h3>\n\n\n<div>Nice bright ambience</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/living/gallery/WQCkior21Gc.jpg\" alt=\"\">\n\n\n<h3>WQ Ckior 21 Gc</h3>\n\n\n<div>Lovely visual interest from the light timber panelling. Like how the fireplace and shelves provide horizontal contrast to the vertical panel.</div>\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=113\">Dining</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=115\">Master Suites</a>\n</p>\n', '<!-- {\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_st