.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Churchill Residence 60 SMART Burner Scaled\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/Churchill-Residence-60-SMART-Burner--scaled.jpeg\",\"content\":\"Like the fireplace and nothing else!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Dx 1500 Frameless Woodland August Design 2\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/dx1500-frameless-woodland-august-design_2.webp\",\"content\":\"Like the fireplace, TV above and built-in shelving.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Eco Smart Flex 50 DB SBS Building AU\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/EcoSmart-Flex_50DB-SBS_Building-AU.jpg\",\"content\":\"Like that the living space has been separated into formal and informal using a dividing wall with a double sided fireplace. Also like the use of stone as a feature material.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Eco Smart Flex 68 BY Brighton Au 1 1\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/EcoSmart-Flex_68BY-Brighton-Au-1_1.jpg\",\"content\":\"Sleek and modern look. Lots of natural light with a nice fireplace.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Eco Smart Flex 68 BY Brighton Au 2\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/EcoSmart-Flex_68BY-Brighton-Au-2.jpg\",\"content\":\"Sleek and modern look with a nice fireplace.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Eco Smart Flex 68 SS Drummoyne AU 3\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/EcoSmart-Flex_68SS-Drummoyne-AU-3.jpg\",\"content\":\"Like the recessed lighting above and below.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Exposed Brick Wall Wooden Floors Simplistic Living Room\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/exposed-brick-wall-wooden-floors-simplistic-living-room.jpeg\",\"content\":\"Like the modern joinery and contrast the black provides.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Flex 68 By Flex Series Camperdown Au 2\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/flex-68by-flex-series-camperdown-au-2.jpg\",\"content\":\"Like the fireplace.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Flex 68 Ss Flex Series Flex 68 Ss Espace\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/flex-68ss-flex-series-flex-68ss-espace.jpg\",\"content\":\"Plain and simple but effective.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Xl 900 Ethanol Burner Pia Ruggeri Xl 900 01 Jpeg\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/xl900-ethanol-burner-pia-ruggeri-xl900-01.jpeg.webp\",\"content\":\"Modern look, good natural light.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Kornacki Residence 38 Firebox SS BLACK Scaled\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/Kornacki-Residence-38-Firebox-SS-BLACK-scaled.jpeg\",\"content\":\"Like the firplace with modern mantelpiece.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Rm 7 Living And Dining Room Jimmy And Tam 014 M Df 960 1500 Px 1\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/rm7-living-and-dining-room-jimmy-and-tam-014_m_df960_1500px_1.webp\",\"content\":\"A small living area that works well. Like the way the fireplace and chimney have been subtly highlighted using white slimline bricks. Like the soft natural light as well.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Wala Kooyong 021 With Flames\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/wala-kooyong-021_with-flames.webp\",\"content\":\"Like the use of different materials. Also like the frameless windows.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Wooden Floors Cubby Couch Cosy Living Room\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/wooden-floors-cubby-couch-cosy-living-room.jpeg\",\"content\":\"Modern look... nice.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Xl 700 Burner Range Barkly St Mornington Jpg\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/xl700-burner-range-barkly-st-mornington.jpg.webp\",\"content\":\"Like the way the firplace has been placed between the dining and living spaces.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Armadale 5\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/armadale5.webp\",\"content\":\"Great natural light from the large windows. Nice simple style and of course, a fireplace!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"R Ok 4 VSMS 3 Ck\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/rOk4VSMS3Ck.jpg\",\"content\":\"Nice bright ambience\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"WQ Ckior 21 Gc\",\"image\":\"images\\/pages\\/brief\\/living\\/gallery\\/WQCkior21Gc.jpg\",\"content\":\"Lovely visual interest from the light timber panelling. Like how the fireplace and shelves provide horizontal contrast to the vertical panel.\"}}]}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":false,\"id\":\"pagination\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-2,1-2\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"right\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"left\",\"content\":\"Dining\",\"link\":\"index.php?Itemid=113\",\"icon\":\"chevron-left\"}}],\"name\":\"Previous\"}]},{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"left\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"right\",\"content\":\"Master Suites\",\"link\":\"index.php?Itemid=115\",\"icon\":\"chevron-right\"}}],\"name\":\"Next\"}]}]}],\"name\":\"Pagination\"}],\"version\":\"2.7.22\"} -->', 1, 2, '2022-04-17 03:24:35', 718, '', '2022-05-05 08:48:50', 718, 0, '0000-00-00 00:00:00', '2022-03-27 04:16:36', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 70, 9, '', '', 1, 841, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
INSERT INTO `q40d7_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`, `note`) VALUES
(6, 67, 'Master Suites', 'master-suites', '<img src=\"/2-birdie-place/images/headers/title-bg-master-suites.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">We would like two “his &amp; hers” master suites. These rooms should have enough space so as to not feel tight or constricted but they do not need to be excessively or extravagantly large. These rooms are a priority for us and we will sacrifice other elements or requirements in order to get these rooms right.</p>\n<p>We would like the two rooms to share a large ensuite but each with a separate WIR. However, we would also consider a shared WIR, individual ensuites or even two ensuites and two WIRs but we are mindful of the additional expense of duplicating bathrooms.</p>\n<p>If possible, for privacy and noise considerations, the master suites should not adjoin the secondary bedrooms.</p></div>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>2 x master suites</div>\n\n    </li>\n        <li>\n\n        \n<div>As large as is practical within the limitations of the design and available space</div>\n\n    </li>\n        <li>\n\n        \n<div>Abundant natural light and ventilation</div>\n\n    </li>\n        <li>\n\n        \n<div>Air conditioned</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div><p class=\"uk-margin-remove\">Large enough to comfortably fit:</p>\n<ul class=\"uk-margin-remove\">\n<li>King bed</li>\n<li>2 x night tables</li>\n<li>Armchair</li>\n</ul></div>\n\n    </li>\n        <li>\n\n        \n<div><p>Each suite with a WIR</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Ceiling fan in each suite</div>\n\n    </li>\n        <li>\n\n        \n<div><p class=\"uk-margin-remove\">Shared “Jack &amp; Jill” ensuite bathroom with access from each suite</p>\n<ul class=\"uk-margin-remove\">\n<li>No bath</li>\n<li>Toilet with a concealed cistern</li>\n<li>Doorless shower</li>\n<li>No glass in shower if practical. If glass is used, it should be frameless</li>\n<li>Long vanity unit with double sink (or one long sink with two tap sets) and large drawers/cupboards</li>\n<li>GPOs at both ends of vanity unit</li>\n<li>Rain showerhead + shower rail</li>\n<li>Large niche or ledge in shower for shampoo etc</li>\n<li>Concealed drains - no unsightly grates. Linear drain in shower?</li>\n<li>Abundant natural light and ventilation</li>\n<li>Window in shower</li>\n<li>Separate his &amp; hers towel rails</li>\n<li>Skylight(s)</li>\n<li>Lockable doors to each suite</li>\n</ul></div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Shared balcony, verandah or breezeway connecting each suite</div>\n\n    </li>\n        <li>\n\n        \n<div>Shared WIR with access from each suite</div>\n\n    </li>\n        <li>\n\n        \n<div><p>A gas or ethanol fireplace and space for a wall mounted TV in one of the suites</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Ensuite bathrooms adjoining each suite (no bath & single sink)</div>\n\n    </li>\n        <li>\n\n        \n<div>Window adjacent to toilet (not essential it opens)</div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/315ww50.webp\" alt=\"\">\n\n\n<h3>315 Ww 50</h3>\n\n\n<div><p>Love this. Simple yet elegant good sized room with \"secret\" panel doors that access the WIR and ensuite. Very nice.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/contemporary-bedroom-ideas-inspiration-10.webp\" alt=\"\">\n\n\n<h3>Contemporary Bedroom Ideas Inspiration 10</h3>\n\n\n<div><p><span>Good natural light and v</span>ery stylish mid-century modern aesthetic. Like the floating bed and the windows looking out onto a green roof.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/contemporary-bedroom-ideas-inspiration-11.webp\" alt=\"\">\n\n\n<h3>Contemporary Bedroom Ideas Inspiration 11</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/modern-master-bedroom-image-sept112018-09-10-at-1.28.36-PM-2.webp\" alt=\"\">\n\n\n<h3>Modern Master Bedroom Image Sept 112018 09 10 At 1 28 36 PM 2</h3>\n\n\n<div><p>Would like to include a fireplace and a wall mounted TV in one of the suites.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/modern-master-bedroom-image-sept112018-09-10-at-1.28.36-PM-11.webp\" alt=\"\">\n\n\n<h3>Modern Master Bedroom Image Sept 112018 09 10 At 1 28 36 PM 11</h3>\n\n\n<div><p>Light, bright simple space. Like that the bedroom has direct access to outside.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/modern-master-bedroom-jan17-00005.webp\" alt=\"\">\n\n\n<h3>Modern Master Bedroom Jan 17 00005</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/modern-master-bedroom-jan17-00008.webp\" alt=\"\">\n\n\n<h3>Modern Master Bedroom Jan 17 00008</h3>\n\n\n<div><p>Small but functional</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/bedroom/two-story-4-bedroom-modern-home-primary-bedroom-feb252021-min.webp\" alt=\"\">\n\n\n<h3>Two Story 4 Bedroom Modern Home Primary Bedroom Feb 252021 Min</h3>\n\n\n<div><p>Like the fireplace with TV unit above, large windows with good natural light, ceiling fan and direct access to outside.</p></div>\n\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/241w16.webp\" alt=\"\">\n\n\n<h3>241 W 16</h3>\n\n\n<div><p>Like the natural light in the shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/256w7.webp\" alt=\"\">\n\n\n<h3>256 W 7</h3>\n\n\n<div><p>Plenty of natural light in the shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/270w7.webp\" alt=\"\">\n\n\n<h3>270 W 7</h3>\n\n\n<div><p>Good natural light in the shower. Like the doorless design with a pony wall separating the shower from the rest of the bathroom</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/411wq6.webp\" alt=\"\">\n\n\n<h3>411 Wq 6</h3>\n\n\n<div><p><span>Love the full height windows and frameless glass in the shower</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/04-walk-in-shower-ideas-decorsnob-1024x684.webp\" alt=\"\">\n\n\n<h3>04 Walk In Shower Ideas Decorsnob 1024 X 684</h3>\n\n\n<div><p>Single glass wall, double entry</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/05-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>05 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p>Like having a window in the show, no doors and 3 shower heads allow 2 people to shower at the same time</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/10-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>10 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p>Like the bold use of colour as a feature and pony walls separating the shower from the rest of the bathroom</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/13-walk-in-shower-ideas-decorsnob-1024x791.webp\" alt=\"\">\n\n\n<h3>13 Walk In Shower Ideas Decorsnob 1024 X 791</h3>\n\n\n<div><p>Like the shower area is on the reverse of a central wall. Don\'t want a bath in the ensuite but a vanity would be well placed in this position instead</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/32-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>32 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p>Love the use of concrete and the window. Like the idea of having a bench in the shower area but not convonced wood would wear well in such a wet and humid environment.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/39-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>39 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p>Like the skylight over the shower area, large niche and long vanity with double sink and big drawers</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/44-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>44 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p><span>Like the double entry and minimal use of (frameless) glass</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/049e73a452e26e533caafdebc6d0843f.webp\" alt=\"\">\n\n\n<h3>049 E 73 A 452 E 26 E 533 Caafdebc 6 D 0843 F</h3>\n\n\n<div><p>Like the concrete and interesting skylight</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/1615346577445_16112025382435.webp\" alt=\"\">\n\n\n<h3>1615346577445 16112025382435</h3>\n\n\n<div><p>Love the aggregate floor, long shelf in the shower and great natural light</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/1615350382696_1603689494849BULLECOURTMOSMAN19571.webp\" alt=\"\">\n\n\n<h3>1615350382696 1603689494849 BULLECOURTMOSMAN 19571</h3>\n\n\n<div><p>Love the dual shower heads and skylight over the shower area</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/1641443324811_bathroom-bathtub.webp\" alt=\"\">\n\n\n<h3>1641443324811 Bathroom Bathtub</h3>\n\n\n<div><p>Good natural light over the vanity area. Love the large shower area with dual shower heads and no doors or glass</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/1643766599883_2-Ensuite.webp\" alt=\"\">\n\n\n<h3>1643766599883 2 Ensuite</h3>\n\n\n<div><p>Like the good natural light from the window and skylight</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/betonowa-%C5%82azienka-mikrocement05.webp\" alt=\"\">\n\n\n<h3>Betonowa Lazienka Mikrocement 05</h3>\n\n\n<div><p>Love the thick, heavy-set concrete bench and integrated sink.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/betonowa-%C5%82azienka-mikrocement06.webp\" alt=\"\">\n\n\n<h3>Betonowa Lazienka Mikrocement 06</h3>\n\n\n<div><p>Like the use of concrete and the doorless shower. Good natural light from the large window</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-02-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 02 1 Kindesign</h3>\n\n\n<div><p>Like the use of concrete and interesting full length skylight. Wouldn\'t want a timber floor in a bathroom at all though</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-10-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 10 1 Kindesign</h3>\n\n\n<div><p>Love the concrete bench with dual integrated sinks. Recessing the vanity into the wall is interesting</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-12-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 12 1 Kindesign</h3>\n\n\n<div><p>Love the concrete, especially the large heavy-set bench and integrated sink. Great natural light in the shower area</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-14-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 14 1 Kindesign</h3>\n\n\n<div><p>Like the use of concrete, the large skylight over the shower and the ledge seat with shower overhead</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-16-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 16 1 Kindesign</h3>\n\n\n<div><p>Love the large skylight, big windows, concrete bench with twin sinks, dual shower heads and large shower niche. Don\'t like the timber floor in the shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-19-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 19 1 Kindesign</h3>\n\n\n<div><p>Like the skylight placed directly over the large concrete vanity</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-01.webp\" alt=\"\">\n\n\n<h3>Shower Seat 01</h3>\n\n\n<div><p>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. Would come in handy as we age too no doubt.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-02.webp\" alt=\"\">\n\n\n<h3>Shower Seat 02</h3>\n\n\n<div><p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. </span><span>Would</span><span> come in handy</span><span> as we age too no doubt.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-03.webp\" alt=\"\">\n\n\n<h3>Shower Seat 03</h3>\n\n\n<div><p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. </span><span>Would</span><span> come in handy</span><span> as we age too no doubt.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-04.webp\" alt=\"\">\n\n\n<h3>Shower Seat 04</h3>\n\n\n<div><p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. </span><span>Would</span><span> come in handy</span><span> as we age too no doubt.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-05.webp\" alt=\"\">\n\n\n<h3>Shower Seat 05</h3>\n\n\n<div><p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. </span><span>Would</span><span> come in handy</span><span> as we age too no doubt.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/shower-seat-06.webp\" alt=\"\">\n\n\n<h3>Shower Seat 06</h3>\n\n\n<div><p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water. </span><span>Would</span><span> come in handy</span><span> as we age too no doubt.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Shower_Ledge_design_sky_window.webp\" alt=\"\">\n\n\n<h3>Shower Ledge Design Sky Window</h3>\n\n\n<div><p>Like the large skylight in the shower and use of a ledge (instead of a niche)</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/stanford-university-klopf-architecture-mid-century-home_dezeen.webp\" alt=\"\">\n\n\n<h3>Stanford University Klopf Architecture Mid Century Home Dezeen</h3>\n\n\n<div><p>Good natural light and large niche in the doorless shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/straw-bale-house-sarah-wigglesworth-refurb-architecture-uk_dezeen.webp\" alt=\"\">\n\n\n<h3>Straw Bale House Sarah Wigglesworth Refurb Architecture Uk Dezeen</h3>\n\n\n<div><p>Like the doorless design of the shower. Don\'t like the dingy lighting</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/zip-litibu-palma-house-mexico_dezeen_1704_col_9.webp\" alt=\"\">\n\n\n<h3>Zip Litibu Palma House Mexico Dezeen 1704 Col 9</h3>\n\n\n<div><p>Like the use of concrete and the large external door providing natural light</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/412n20.webp\" alt=\"\">\n\n\n<h3>412 N 20</h3>\n\n\n<div><p><i>LOVE</i> the shower opening up onto a private outdoor space</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/483w25.webp\" alt=\"\">\n\n\n<h3>483 W 25</h3>\n\n\n<div><p>Good natural light in the shower. Like the use of a central wall with the shower on the reverse side of the sinks</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/529w20.webp\" alt=\"\">\n\n\n<h3>529 W 20</h3>\n\n\n<div><p>Good natural light and ventilation in the shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/570w32.webp\" alt=\"\">\n\n\n<h3>570 W 32</h3>\n\n\n<div><p>Like the good light and ventilation from the large windows and louvres</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/570W34.webp\" alt=\"\">\n\n\n<h3>570 W 34</h3>\n\n\n<div><p>Like the natural light and ventilation also the doorless shower with frameless glass</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/2017553212_9_1_220127_075033-w1600-h1067.webp\" alt=\"\">\n\n\n<h3>2017553212 9 1 220127 075033 W 1600 H 1067</h3>\n\n\n<div>Like the large long single sink with twin taps. Also like the marble finish.</div>\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=114\">Living</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=116\">Bedrooms</a>\n</p>\n', '<!-- {\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-master-suites.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Hero\"},{\"name\":\"Details\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding\":\"none\",\"padding_remove_bottom\":true,\"animation_delay\":false,\"animation\":\"fade\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"vertical_align\":false},\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"1-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Brief\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\"}},{\"name\":\"\",\"type\":\"grid\",\"props\":{\"show_title\":true,\"show_meta\":true,\"show_content\":true,\"show_image\":true,\"show_link\":true,\"grid_default\":\"1\",\"grid_medium\":\"1\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"image_align\":\"top\",\"image_grid_width\":\"1-2\",\"link_text\":\"Visit Page\",\"link_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"title_align\":\"top\",\"title_grid_width\":\"1-2\",\"title_grid_breakpoint\":\"m\",\"meta_element\":\"h4\",\"content_column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"item_animation\":true,\"title_style\":\"h5\"},\"children\":[{\"name\":\"\",\"type\":\"grid_item\",\"props\":{\"title\":\"Last Revised\"},\"source\":{\"query\":{\"name\":\"article\"},\"props\":{\"_condition\":{\"filters\":{\"condition\":\"!!\"},\"name\":\"publish_up\"},\"meta\":{\"filters\":{\"search\":\"\",\"date\":\"j F, Y\"},\"name\":\"modified\"}}}}]}]},{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"2-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p class=\\\"uk-text-lead\\\">We would like two \\u201chis &amp; hers\\u201d master suites. These rooms should have enough space so as to not feel tight or constricted but they do not need to be excessively or extravagantly large. These rooms are a priority for us and we will sacrifice other elements or requirements in order to get these rooms right.<\\/p>\\n<p>We would like the two rooms to share a large ensuite but each with a separate WIR. However, we would also consider a shared WIR, individual ensuites or even two ensuites and two WIRs but we are mindful of the additional expense of duplicating bathrooms.<\\/p>\\n<p>If possible, for privacy and noise considerations, the master suites should not adjoin the\\u00a0secondary bedrooms.<\\/p>\"}},{\"type\":\"alert\",\"props\":{\"title_element\":\"h3\",\"alert_style\":\"primary\",\"title\":\"<i>Note<\\/i>\",\"content\":\"<p><i>The images\\u00a0in the gallery on this page illustrate features and elements\\u00a0of interest and do not necessarily represent the overall design style we are wanting to achieve.<\\/i><\\/p>\",\"content_margin\":\"remove\",\"title_inline\":true,\"alert_size\":true},\"name\":\"Alert\"}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab essential\",\"attributes\":\"tabtitle=\\\"Essential\\\"\",\"id\":\"essential\",\"padding_remove_top\":false,\"preserve_color\":false,\"overlap\":false,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"class\":\"essential\",\"width\":\"small\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Essential\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Essential\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"2 x master suites\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"As large as is practical within the limitations of the design and available space\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"name\":\"\",\"type\":\"list_item\",\"props\":{\"content\":\"Abundant natural light and ventilation\",\"icon\":\"\",\"icon_color\":\"primary\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Air conditioned\"}}]}]}]}],\"name\":\"Essential\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm