570 W 34\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/570W34.webp\",\"content\":\"<p>Like the natural light and ventilation also the doorless shower with frameless glass<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2017553212 9 1 220127 075033 W 1600 H 1067\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/2017553212_9_1_220127_075033-w1600-h1067.webp\",\"content\":\"Like the large long single sink with twin taps. Also like the marble finish.\"}}]}]}],\"props\":{\"width\":\"expand\",\"column_gap\":\"collapse\",\"margin\":\"default\"}}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":true,\"id\":\"pagination\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-2,1-2\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"right\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"left\",\"content\":\"Living\",\"link\":\"index.php?Itemid=114\",\"icon\":\"chevron-left\"}}],\"name\":\"Previous\"}]},{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"left\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"right\",\"content\":\"Bedrooms\",\"link\":