(7, 68, 'Bedrooms', 'bedrooms', '<img src=\"/2-birdie-place/images/headers/title-bg-bedrooms.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">At least one of the secondary bedrooms should be large enough to fit a desk and chair for use by a student.</p>\n<p>Future resale appeal is a consideration.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Large enough to comfortably fit a queen bed + 2 side tables</div>\n\n    </li>\n        <li>\n\n        \n<div>Ceiling fan</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div><p>Room for additional furniture e.g. desk + chair</p></div>\n\n    </li>\n        <li>\n\n        \n<div>WIR to each</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<div>\n\n    \n<div>BIR to each</div>\n\n</div>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bedrooms/gallery/2016208714_6_1_200417_044050-w4134-h2756.webp\" alt=\"\">\n\n\n<h3>2016208714 6 1 200417 044050 W 4134 H 2756</h3>\n\n\n<div><p>The two minor bedrooms need to fit a queen bed and two side tables. If they can accommodate additional furniture such as an armchair, desk etc, that would be highly desirable.</p>\n<p>Storage should be either a WIR or BIR to each room.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bedrooms/gallery/2016587559_8_1_201029_063533-w2100-h1400.webp\" alt=\"\">\n\n\n<h3>2016587559 8 1 201029 063533 W 2100 H 1400</h3>\n\n\n<div><p>The two minor bedrooms need to fit a queen bed and two side tables. If they can accommodate additional furniture such as an armchair, desk etc, th