INSERT INTO `q40d7_content` (`id`, `asset_id`, `title`, `alias`, `introtext`, `fulltext`, `state`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`, `note`) VALUES
(8, 69, 'Bathroom', 'bathroom', '<img src=\"/2-birdie-place/images/headers/title-bg-bathroom.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">If the design includes a doorless shower then it must be situated so as to minimise water spillage into the rest of the bathroom. If this can’t be achieved then a door to the shower should be used.</p>\n<p>Wet areas (bath/shower) should be sited as far from the entry door as possible. Only a single sink is required.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Shower</div>\n\n    </li>\n        <li>\n\n        \n<div>Separate bath</div>\n\n    </li>\n        <li>\n\n        \n<div>Single Sink</div>\n\n    </li>\n        <li>\n\n        \n<div>Good size vanity with drawers and cupboards</div>\n\n    </li>\n        <li>\n\n        \n<div>Where glass is used, it should be frameless</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Good ventilation</div>\n\n    </li>\n        <li>\n\n        \n<div>Skylight</div>\n\n    </li>\n        <li>\n\n        \n<div>Concealed toilet cistern</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Separate toilet</div>\n\n    </li>\n        <li>\n\n        \n<div>Storage for towels</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Standard garden tap fitted out of sight (will be used with a hose to clean the floor)</p></div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/270w7.webp\" alt=\"\">\n\n\n<h3>270 W 7</h3>\n\n\n<div><p>Good natural light in the shower. Like the doorless design with a half wall separating the shower from the rest of the bathroom</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/39-walk-in-shower-ideas-decorsnob.webp\" alt=\"\">\n\n\n<h3>39 Walk In Shower Ideas Decorsnob</h3>\n\n\n<div><p>Like the skylight over the shower area, large niche and long vanity with double sink and big drawers</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/betonowa-%C5%82azienka-mikrocement06.webp\" alt=\"\">\n\n\n<h3>Betonowa Lazienka Mikrocement 06</h3>\n\n\n<div><p>Like the use of concrete and the doorless shower. Good natural light from the large window</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/Concrete-Bathroom-Designs-12-1-Kindesign.webp\" alt=\"\">\n\n\n<h3>Concrete Bathroom Designs 12 1 Kindesign</h3>\n\n\n<div><p>Love the concrete, especially the large heavy-set bench and integrated sink. Great natural light in the shower area</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/master-suites/gallery/ensuite/stanford-university-klopf-architecture-mid-century-home_dezeen.webp\" alt=\"\">\n\n\n<h3>Stanford University Klopf Architecture Mid Century Home Dezeen</h3>\n\n\n<div><p>Good natural light and large niche in the doorless shower</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/02-01-frameless-shower-screen-nsw-sydney.webp\" alt=\"\">\n\n\n<h3>02 01 Frameless Shower Screen Nsw Sydney</h3>\n\n\n<div>Has all the elements we need want the main bathroom. Don\'t like tiled floors however and don\'t need two sinks.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/227w12.webp\" alt=\"\">\n\n\n<h3>227 W 12</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Good natural light and ventilation. Nice to have a outdoor aspect.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/241w19.webp\" alt=\"\">\n\n\n<h3>241 W 19</h3>\n\n\n<div>This layout would function just fine as our main bathroom.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/317s68.webp\" alt=\"\">\n\n\n<h3>317 S 68</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Would want more vanity space though and perhaps not have the bath inside the shower.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/483w16.webp\" alt=\"\">\n\n\n<h3>483 W 16</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Like the big window and mid-century hue.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/509w38.webp\" alt=\"\">\n\n\n<h3>509 W 38</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Clean, simple and practical. Don\'t want a tiled floor however.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/2017571924_14_1_220204_024655-w4134-h2756.webp\" alt=\"\">\n\n\n<h3>2017571924 14 1 220204 024655 W 4134 H 2756</h3>\n\n\n<div>This layout would work very well for us. Just not in brown!</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/ELyPkGrQ.webp\" alt=\"\">\n\n\n<h3>E Ly Pk Gr Q</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Like the skylight over the shower.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/New-Project-4.webp\" alt=\"\">\n\n\n<h3>New Project 4</h3>\n\n\n<div>Good light and ventilation in the shower.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/r-architecture-HQCW1gTMjek-unsplash.webp\" alt=\"\">\n\n\n<h3>R Architecture HQCW 1 G T Mjek Unsplash</h3>\n\n\n<div>This layout would function just fine as our main bathroom.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/2017571924_17_1_220204_024655-w4134-h2756.webp\" alt=\"\">\n\n\n<h3>2017571924 17 1 220204 024655 W 4134 H 2756</h3>\n\n\n<div>This layout would work for us. Like the pop of colour from the tiles used around the bath.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/bathroom/gallery/New-Project-7.webp\" alt=\"\">\n\n\n<h3>New Project 7</h3>\n\n\n<div>This layout would function just fine as our main bathroom. Like the large windows.</div>\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=116\">Bedrooms</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=118\">Laundry</a>\n</p>\n', '<!-- {\"name\":\"Page - Brief - v3\",\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-bathroom.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{