(9, 70, 'Laundry', 'laundry', '<img src=\"/2-birdie-place/images/headers/title-bg-laundry.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">Although this is a utility room, we would like the aesthetic to be in keeping with the rest of the design.</p>\n<p>If costs need to be reduced, this room could be eliminated for a more cost efficient solution such as combining the laundry functions into the garage space.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Internal access (can be via garage if necessary)</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Room for top loading washer &amp; dryer</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Sink</div>\n\n    </li>\n        <li>\n\n        \n<div>Ample storage</div>\n\n    </li>\n        <li>\n\n        \n<div>Bench (min 1m)</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>External access</div>\n\n    </li>\n        <li>\n\n        \n<div>Large sink (for washing pets)</div>\n\n    </li>\n        <li>\n\n        \n<div>Room enough for pet eating space/mat</div>\n\n    </li>\n        <li>\n\n        \n<div>Large bench (≥ 1.5m)</div>\n\n    </li>\n        <li>\n\n        \n<div>Dryer space vented to outside</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Room to fit a small kennel</div>\n\n    </li>\n        <li>\n\n        \n<div>Shower</div>\n\n    </li>\n        <li>\n\n        \n<div>Toilet</div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/15540_image4-1.webp\" alt=\"\">\n\n\n<h3>15540 Image 4 1</h3>\n\n\n<div>Lots of storage and bench space and external access.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/1438240657847_hg0314rooms-laundries-201211162849880297R1.webp\" alt=\"\">\n\n\n<h3>1438240657847 Hg 0314 Rooms Laundries 201211162849880297 R 1</h3>\n\n\n<div>Lots of storage and bench space and external access. Like the idea of easily accessible hanging space.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/1616079493137.webp\" alt=\"\">\n\n\n<h3>1616079493137</h3>\n\n\n<div>If necessary, we would consider placing the laundry within the garage.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/1616558324353_1611115721626Untitleddesign-2021-01-20T134814.474.webp\" alt=\"\">\n\n\n<h3>1616558324353 1611115721626 Untitleddesign 2021 01 20 T 134814 474</h3>\n\n\n<div>Lots of storage, bench space and external access. We need a large sink though.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/Cherrybrook-Laundry-017-RET.webp\" alt=\"\">\n\n\n<h3>Cherrybrook Laundry 017 RET</h3>\n\n\n<div>Lots of storage and bench space with external, access.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/garage-laundry-room-1024x1024.webp\" alt=\"\">\n\n\n<h3>Garage Laundry Room 1024 X 1024</h3>\n\n\n<div>If necessary, we would consider placing the laundry within the garage.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/MA221.webp\" alt=\"\">\n\n\n<h3>MA 221</h3>\n\n\n<div>Lots of bench space. Like the easily accessible hanging space.</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/laundry/gallery/MA139.webp\" alt=\"\">\n\n\n<h3>MA 139</h3>\n\n\n<div>Lots of storage 