(10, 71, 'Office', 'office', '<img src=\"/2-birdie-place/images/headers/title-bg-office.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">The office is a crucial space and will be used daily in the running of our business. This room will see upwards of 60+ hours of use per week so the overall design and ambiance of the room is important to us as it will be heavily utilised.</p>\n<p>We would like the room to be more than just a practical utilitarian space in which to do work. If possible, in addition to a desk, we would like this space to be large enough for built in joinery (bookcase/shelving/cupboards), a lounge with a pull-out bed or even a <a href=\"https://www.sepsion.com.au/bed-range\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"What\'s a Murphy bed? Click to find out\">Murphy bed</a> allowing the room to also function as a small den and guest bedroom.</p>\n<p>The space must have abundant natural light and ventilation and an outlook that provides visual interest such as into the garden or private courtyard is essential. We do not want to spend the day looking at the goings-on in the street or staring at the neighbour\'s fence.</p>\n<p>FSR restrictions and budget permitting, ideally we would like the office to be a small freestanding structure that could also function as a guest bedroom. In this situation a small ensuite bathroom incorporated into the design would be highly desirable. To this end, we would consider a <a href=\"https://www.melwoodcedarsheds.com.au/\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"Visit the Melwood website, an Aussie company manufacturing garden rooms\">pre-fabricated building</a> or even a structure <a href=\"https://aussietinyhouses.com.au/tiny-house-trailers/\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"View trailer chassis prices\">built on a trailer chassis</a> that could be assembled off-site. </p>\n<p>Whether an internal room inside the home or an external free standing building in the garden, at the very least, with some creativity, we think we can make this room function very well as an office with the ability to be able to quickly and easily convert to a guest bedroom.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div><p>Privacy - must be enclosed with a locking door and not open plan or a study nook</p></div>\n\n    </li>\n        <li>\n\n        \n<div><p>Large enough to fit an 1800mm desk</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Abundant natural light and ventilation</div>\n\n    </li>\n        <li>\n\n        \n<div>Air conditioned</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Quiet - away from main living areas</div>\n\n    </li>\n        <li>\n\n        \n<div>Multi-purpose e.g. can also function as a guest bedroom, den or small TV/media room</div>\n\n    </li>\n        <li>\n\n        \n<div>Large enough to fit additional furniture e.g. bookcase, TV + 2-3 seater couch</div>\n\n    </li>\n        <li>\n\n        \n<div>Ability to open the room up e.g. French, bi-fold or stacking doors</div>\n\n    </li>\n        <li>\n\n        \n<div>Ceiling fan</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Separate from main house</div>\n\n    </li>\n        <li>\n\n        \n<div>Gas or ethanol fireplace</div>\n\n    </li>\n        <li>\n\n        \n<div>Room to fit a large (1.5m-2m) aquarium</div>\n\n    </li>\n    </ul>\n<h2>Dislikes</h2>\n<ul>\n        <li>\n\n        \n<div><p>Noise of any kind - unless it\'s birds 🦜 or the rain 🌧</p></div>\n\n    </li>\n        <li>\n\n        \n<div><p>A bland, uniteresting and uninspiring outlook or worse, no view at all</p></div>\n\n    </li>\n    </ul>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/2ed3b2d4a92846c8d69955145b495b44.webp\" alt=\"\">\n\n\n<h3>2 Ed 3 B 2 D 4 A 92846 C 8 D 69955145 B 495 B 44</h3>\n\n\n<div><p>Elegant, neat and compact. Plenty of storage, large desk and good natural light.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/2ykyg8rw-1607110213.jpeg\" alt=\"\">\n\n\n<h3>2 Ykyg 8 Rw 1607110213</h3>\n\n\n<div><p>Not big on the style but there\'s lots of storage, two arm chairs, a fireplace, mantel, TV and French doors. What else could you want?</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/Extraordinary-Modern-Home-Office-Designs.jpeg\" alt=\"\">\n\n\n<h3>16 Extraordinary Modern Home Office Designs That Will Inspire And Motivate You 10</h3>\n\n\n<div><p>Nice big desk space bathed in natural light.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/6285499718350245888.webp\" alt=\"\">\n\n\n<h3>6285499718350245888</h3>\n\n\n<div><p>Good natural light, bookshelves and storage and a fireplace. A hint of mid-century style as well... nice.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/6429460059617705984.webp\" alt=\"\">\n\n\n<h3>6429460059617705984</h3>\n\n\n<div><p>This image is here if only for the absolutely epic skylight!</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/6522317522019385344.webp\" alt=\"\">\n\n\n<h3>6522317522019385344</h3>\n\n\n<div><p>Love the wondow overlooking bamboo - very Zen. Like the long desk and bookcase in mid-century style.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/6594971659138129920.jpeg\" alt=\"\">\n\n\n<h3>6594971659138129920</h3>\n\n\n<div><p>Nice big windows. Simple but elegant style.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/6676853734374445056.webp\" alt=\"\">\n\n\n<h3>6676853734374445056</h3>\n\n\n<div><p>Great desk, bookcase and cupboards. Like the mid-century feel.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/a3936c1e32bac5e5ad0b261d5397f845.jpeg\" alt=\"\">\n\n\n<h3>A 3936 C 1 E 32 Bac 5 E 5 Ad 0 B 261 D 5397 F 845</h3>\n\n\n<div><p>Small but simple and practical. Wouldn\'t want to stare at that black wall all day though!</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/home-office-06.webp\" alt=\"\">\n\n\n<h3>Home Office 06</h3>\n\n\n<div><p>Like the garden aspect and skylight.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/home-office-shelving.1.webp\" alt=\"\">\n\n\n<h3>Home Office Shelving 1</h3>\n\n\n<div><p>Like the bookcase and lots of storage.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/kew-courtyard-house-drawing-room-architecture-5db36de6.webp\" alt=\"\">\n\n\n<h3>Kew Courtyard House Drawing Room Architecture 5 Db 36 De 6</h3>\n\n\n<div><p>Small, simple and practical.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/Masculine-home-office-ideas2.jpeg\" alt=\"\">\n\n\n<h3>Masculine Home Office Ideas 2</h3>\n\n\n<div><p>Fireplace! That is all.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/Masculine-home-office-ideas13.webp\" alt=\"\">\n\n\n<h3>Masculine Home Office Ideas 13</h3>\n\n\n<div><p>Love the desk. Good natural light.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/My_Modern_Home_Plan_No9-19_-_Home_Office.width-800.jpg\" alt=\"\">\n\n\n<h3>My Modern Home Plan No 9 19 Home Office Width 800</h3>\n\n\n<div><p>Good natural light (even though the pic doesn\'t show it). Like the mid-century feel.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/internal/standing-room-only.jpeg\" alt=\"\">\n\n\n<h3>Standing Room Only If Youre In Need Of Home Office Ideas For Small Spaces Consider A Fold Down Desk That Allows You To Stand While Working This One A New Table Concept By Resource Furniture Is A Great Option Comfortable Seating Ample Stora</h3>\n\n\n<div><p>Even very small could work. Like the stand-up desk but it would need to be height adjustable to allow for sitting when needed.</p></div>\n\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/16-Extraordinary-Modern-Home-Office-Designs-That-Will-Inspire-And-Motivate-You-6-1280x720.jpeg\" alt=\"\">\n\n\n<h3>16 Extraordinary Modern Home Office Designs That Will Inspire And Motivate You 6 1280 X 720</h3>\n\n\n<div><p>Big desk, big windows, courtyard view.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/16-Extraordinary-Modern-Home-Office-Designs-That-Will-Inspire-And-Motivate-You-12.webp\" alt=\"\">\n\n\n<h3>16 Extraordinary Modern Home Office Designs That Will Inspire And Motivate You 12</h3>\n\n\n<div><p>Bookcase, cupboards, fresh air, private courtyard. Like it all.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/8336.webp\" alt=\"\">\n\n\n<h3>8336</h3>\n\n\n<div><p>Good light, overhead bookcase, <span>windows that open onto a private courtyard. Very nice.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/corner-courtyard-residence-wiedemann-architects-llc-img_96415ccc0d0aaffd_14-8059-1-bcd45bf.webp\" alt=\"\">\n\n\n<h3>Corner Courtyard Residence Wiedemann Architects Llc Img 96415 Ccc 0 D 0 Aaffd 14 8059 1 Bcd 45 Bf</h3>\n\n\n<div><p>Ohm!</p>\n<p>To be honest, the lighting is very dhingy but with some bamboo and running water, this could be a nice outlook.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/11281115-home-office-glass-wall-facing.webp\" alt=\"\">\n\n\n<h3>11281115 Classic Office Chair With Black Leather Seat And Orange Designer Pouffe In Home Office Glass Wall Facing</h3>\n\n\n<div><p>Great light, nice outlook.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/a-minimalist-home-office-with-a-small-courtyard.jpeg\" alt=\"\">\n\n\n<h3>A Minimalist Home Office With An Open Shelf A Desk With Navy Drawers A White Chair And A Small Courtyard</h3>\n\n\n<div><p>Even a small courtyard can work.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/b489b2b6c010ee54c627db73909affa3.webp\" alt=\"\">\n\n\n<h3>B 489 B 2 B 6 C 010 Ee 54 C 627 Db 73909 Affa 3</h3>\n\n\n<div><p>Like the large windows facing into a simple but pleasant courtyard.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/office-study-space.webp\" alt=\"\">\n\n\n<h3>Office Study Space</h3>\n\n\n<div><p>Like the long desk under a huge window overlooking a private courtyard. Also like the joinery.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/courtyard/6280239486192119808.webp\" alt=\"\">\n\n\n<h3>6280239486192119808</h3>\n\n\n<div><p>Love the cabinetry. Love the soft natural light and nice private little courtyard even more.</p></div>\n\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/796afc5a15c7e859ade80e217697ec5bb18f4c11.webp\" alt=\"\">\n\n\n<h3>796 Afc 5 A 15 C 7 E 859 Ade 80 E 217697 Ec 5 Bb 18 F 4 C 11</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/25900650-8106319-image-a-3_1584039952691.jpeg\" alt=\"\">\n\n\n<h3>25900650 8106319 Image A 3 1584039952691</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/256337187_266478382109224_428771881756208649_n.webp\" alt=\"\">\n\n\n<h3>256337187 266478382109224 428771881756208649 N</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/blackburn-office-studio-backyard-room-img_fa81f93d0497793c_9-6771-1-62070c8.jpeg\" alt=\"\">\n\n\n<h3>Blackburn Office Studio Backyard Room Img Fa 81 F 93 D 0497793 C 9 6771 1 62070 C 8</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/ca22440e-b17d-41a8-ad0c-4166641ea0ae-1333x535.webp\" alt=\"\">\n\n\n<h3>Ca 22440 E B 17 D 41 A 8 Ad 0 C 4166641 Ea 0 Ae 1333 X 535</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/office/gallery/garden/contemporary-patio-img_4c51ec54080a215c_9-5082-1-0d1cab8.webp\" alt=\"\">\n\n\n<h3>Contemporary Patio Img 4 C 51 Ec 54080 A 215 C 9 5082 1 0 D 1 Cab 8</h3>\n\n\n<div>Garden office / studio</div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/image