g_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Hero\"},{\"name\":\"Details\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_bottom\":true,\"animation_delay\":false,\"animation\":\"fade\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"vertical_align\":false},\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"1-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Brief\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\"}},{\"name\":\"\",\"type\":\"grid\",\"props\":{\"show_title\":true,\"show_meta\":true,\"show_content\":true,\"show_image\":true,\"show_link\":true,\"grid_default\":\"1\",\"grid_medium\":\"1\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"image_align\":\"top\",\"image_grid_width\":\"1-2\",\"link_text\":\"Visit Page\",\"link_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"title_align\":\"top\",\"title_grid_width\":\"1-2\",\"title_grid_breakpoint\":\"m\",\"meta_element\":\"h4\",\"content_column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"item_animation\":true,\"title_style\":\"h5\"},\"children\":[{\"name\":\"\",\"type\":\"grid_item\",\"props\":{\"title\":\"Last Revised\"},\"source\":{\"query\":{\"name\":\"article\"},\"props\":{\"_condition\":{\"filters\":{\"condition\":\"!!\"},\"name\":\"publish_up\"},\"meta\":{\"filters\":{\"search\":\"\",\"date\":\"j F, Y\"},\"name\":\"modified\"}}}}]}]},{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"2-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p class=\\\"uk-text-lead\\\">The office is a crucial space and will be used daily in the running of our business. This room will see upwards of 60+ hours of use per week so the overall design and ambiance of the room is important to us as it will be heavily utilised.<\\/p>\\n<p>We would like the room to be more than just a practical utilitarian space in which to do work. If possible, in addition to a desk, we would like this space to be large enough for built in joinery (bookcase\\/shelving\\/cupboards), a lounge with a pull-out bed or even a <a href=\\\"https:\\/\\/www.sepsion.com.au\\/bed-range\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" title=\\\"What\'s a Murphy bed? Click to find out\\\">Murphy bed<\\/a> allowing the room to also function as a\\u00a0small den and guest bedroom.<\\/p>\\n<p>The space must have abundant natural light and ventilation and an outlook that provides visual interest such as into the garden or private courtyard is essential. We do not want to\\u00a0spend the day looking at the goings-on in the street or staring at the neighbour\'s fence.<\\/p>\\n<p>FSR\\u00a0restrictions and budget permitting, ideally we would like the office to be a small freestanding structure that could also function as a guest bedroom. In this situation a small ensuite bathroom incorporated into the design would be highly desirable. To this end, we would consider a <a href=\\\"https:\\/\\/www.melwoodcedarsheds.com.au\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" title=\\\"Visit the Melwood website, an Aussie company manufacturing garden rooms\\\">pre-fabricated building<\\/a> or even a structure <a href=\\\"https:\\/\\/aussietinyhouses.com.au\\/tiny-house-trailers\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\" title=\\\"View trailer chassis prices\\\">built on a trailer chassis<\\/a> that could be assembled off-site.\\u00a0<\\/p>\\n<p>Whether an internal room inside the home or an external free standing building in the garden, at the very least, with\\u00a0some\\u00a0creativity, we think we can make this room function very well as an office with the ability to be able to quickly and easily convert to a guest bedroom.<\\/p>\"}}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab essential\",\"attributes\":\"tabtitle=\\\"Essential\\\"\",\"id\":\"essential\",\"padding_remove_top\":false,\"preserve_color\":false,\"overlap\":false,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"class\":\"essential\",\"width\":\"xsmall\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Essential\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Essential\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\"},\"children\":[{\"name\":\"\",\"type\":\"list_item\",\"props\":{\