(12, 73, 'Outdoor Living', 'outdoor-living', '<img src=\"/2-birdie-place/images/headers/title-bg-outdoors.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">A significant portion of our meals are cooked and eaten outside - particularly in warmer months and an outdoor kitchen area is important. Direct access to the kitchen would be highly desireable.</p>\n<p>We would also like a wood fireplace and/or space to safely install a firepit.</p>\n<p>The eastern aspect of the site overlooks a watercourse and the site boundry adjoins the water\'s edge. We would like at least some of the outdoor space to take advantage of this aspect.</p>\n<p>As much as is possible, we would like our outdoor space(s) to be private with sightlines from the street and northern boundary blocked.</p>\n<p>We currently have a pet cat and plan on aquiring a small dog as well once this project is complete. We do not allow our cat outside unsupervised as she is a threat to native fauna.</p>\n<p>If it can be accommodated, we would like a private internal courtyard/garden. This can be large or small. Aside from the privacy and tranquility we think this will afford us, it will also be an ideal space for pets as it will allow us to let them outdoors without constant supervision.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Outdoor BBQ/cooking area</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Somewhere to dry clothes</p></div>\n\n    </li>\n        <li>\n\n        \n<div>Low maintenance</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Well lit as we will use the outdoor spaces a lot at night</p></div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div><p><span>Private - use of screens, walls etc to minimise sight lines from the street and neigbouring properties</span></p></div>\n\n    </li>\n        <li>\n\n        \n<div><p>Inner courtyard</p></div>\n\n    </li>\n        <li>\n\n        \n<div>BBQ and outdoor eating area situated near the kitchen</div>\n\n    </li>\n        <li>\n\n        \n<div>Direct access to kitchen from BBQ area</div>\n\n    </li>\n        <li>\n\n        \n<div>Maximise easterly (water view) aspect</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for 6 seat table</div>\n\n    </li>\n        <li>\n\n        \n<div>Space for outdoor lounge suite</div>\n\n    </li>\n        <li>\n\n        \n<div><span class=\"highlight\">Sink and bench/prep area near BBQ</span></div>\n\n    </li>\n        <li>\n\n        \n<div>Fireplace/firepit area</div>\n\n    </li>\n        <li>\n\n        \n<div>Wood storage bay with space to store 1m<sup>3</sup> of fuel</div>\n\n    </li>\n        <li>\n\n        \n<div><p>If timber is used for decking, it must be hard wearing and low maintenance</p></div>\n\n    </li>\n        <li>\n\n        \n<div><p>If the space intended for the dining table is not undercover then an integrated retractable shade/shelter to allow use in all weather should be considered</p></div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<div>\n\n    \n<div><p>We like the sound of running water and keep aquarium fish as a hobby. If possible, a koi pond integrated into the outdoor space or courtyard would be lovely. If this could be sited near the office, even better!</p></div>\n\n</div>\n<h2>Impressions</h2>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/10-plants-for-courtyard-gardens-design.webp\" alt=\"\">\n\n\n<h3>10 Plants For Courtyard Gardens Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/38c672b01acf616343ecf8f3f1012a26.webp\" alt=\"\">\n\n\n<h3>38 C 672 B 01 Acf 616343 Ecf 8 F 3 F 1012 A 26</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/000ws1.webp\" alt=\"\">\n\n\n<h3>000 Ws 1</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/81b96b4095412fbbb5a7c6ff39c3c126.webp\" alt=\"\">\n\n\n<h3>81 B 96 B 4095412 Fbbb 5 A 7 C 6 Ff 39 C 3 C 126</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/2656a8281f6127c86f6c3b549e93fb75.webp\" alt=\"\">\n\n\n<h3>2656 A 8281 F 6127 C 86 F 6 C 3 B 549 E 93 Fb 75</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/a-brutalist-tropical-home-in-bali-indonesia-concrete-house.webp\" alt=\"\">\n\n\n<h3>A Brutalist Tropical Home In Bali Indonesia Concrete House</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/contemporary-courtyard-garden-design.webp\" alt=\"\">\n\n\n<h3>Contemporary Courtyard Garden Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/courtyard-design-house-plans.webp\" alt=\"\">\n\n\n<h3>Courtyard Design House Plans</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/62nj.webp\" alt=\"\">\n\n\n<h3>62 Nj</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/courtyard-design.webp\" alt=\"\">\n\n\n<h3>Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/courtyard-garden-design.webp\" alt=\"\">\n\n\n<h3>Courtyard Garden Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/courtyard-gardens-design.webp\" alt=\"\">\n\n\n<h3>Courtyard Gardens Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/Courtyard-with-vertical-garden.webp\" alt=\"\">\n\n\n<h3>Courtyard With Vertical Garden</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/Courtyard-with-water-feature.webp\" alt=\"\">\n\n\n<h3>Courtyard With Water Feature</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/e42baa1d47debe66f79ce0cd8a597dec.webp\" alt=\"\">\n\n\n<h3>E 42 Baa 1 D 47 Debe 66 F 79 Ce 0 Cd 8 A 597 Dec</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/Enclosed-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Enclosed Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/house-with-a-courtyard-pond.webp\" alt=\"\">\n\n\n<h3>House With A Courtyard Pond</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/Growing-Green-Office_102-Studio_dezeen_468_7.webp\" alt=\"\">\n\n\n<h3>Growing Green Office 102 Studio Dezeen 468 7</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/house-with-multiple-courtyards.webp\" alt=\"\">\n\n\n<h3>House With Multiple Courtyards</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/interior-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Interior Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/Mini-courtyard-ideas.webp\" alt=\"\">\n\n\n<h3>Mini Courtyard Ideas</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/modern-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Modern Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/outdoor-courtyard-design-ideas.webp\" alt=\"\">\n\n\n<h3>Outdoor Courtyard Design Ideas</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/outdoor-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Outdoor Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/residential-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Residential Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/small-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Small Courtyard Design</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/x3tmw7fbttum_taller_estilo_el_nido_.webp\" alt=\"\">\n\n\n<h3>X 3 Tmw 7 Fbttum Taller Estilo El Nido</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/shaded-courtyard-garden-design-ideas.webp\" alt=\"\">\n\n\n<h3>Shaded Courtyard Garden Design Ideas</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/courtyard/small-house-courtyard-design.webp\" alt=\"\">\n\n\n<h3>Small House Courtyard Design</h3>\n\n\n\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/outdoor-living/gallery/kitc