(13, 74, 'Pool', 'pool', '<img src=\"/2-birdie-place/images/headers/title-bg-pool.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">We would like to incorporate a small plunge pool. The pool will be used for cooling off, relaxation and conversation after work. It won’t be used by children (no bombs) or for exercise/laps (the estate has two large community pools for this purpose).</p>\n<p>It’s important the pool is sited well and looks integral to the overall aesthetic of the building and not an “add-on” that has been dropped into the site as an afterthought.</p>\n<p>We don\'t care of the pool is round, square or rectangular but it should be at least 1.5m deep. It can be in-ground, semi in-ground or fully above ground. </p>\n<p>We would like the pool to be incorporated as a feature element if possible and not tucked away into a corner. To this end, we would consider situating the pool within the main outdoor space or a central courtyard within the house.</p>\n<p>As far as we know, there is only one other property within the estate that has a private pool. We see the inclusion of a pool as a desirable feature that will add future buyer appeal to the home.</p>\n<p>If the overall project budget or space become an issue, we will consider removing the pool element.</p></div>\n<div>\n\n        <h3><i>Note</i></h3>\n    \n        <div><p><i>The images in the gallery on this page illustrate features and elements of interest and do not necessarily represent the overall design style we are wanting to achieve.</i></p></div>\n    \n</div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>Small plunge pool style - will primarily be used for sitting/relaxing/social conversation</div>\n\n    </li>\n        <li>\n\n        \n<div>Minimum 1.5m deep</div>\n\n    </li>\n        <li>\n\n        \n<div>Well integrated into the outdoor space</div>\n\n    </li>\n        <li>\n\n        \n<div>Private & secluded - cannot be seen from street</div>\n\n    </li>\n        <li>\n\n        \n<div>Pool style should compliment the overall design aesthetic of the home</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Bright, sunny location</div>\n\n    </li>\n        <li>\n\n        \n<div>Concealed filter, pump and plumbing</div>\n\n    </li>\n        <li>\n\n        \n<div>Quiet operation</div>\n\n    </li>\n        <li>\n\n        \n<div>Heated</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<div>\n\n    \n<div>Outdoor shower head nearby</div>\n\n</div>\n<h2>Impressions</h2>\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/00fcfc631099971a3548e42b1ce4fd0d.webp\" alt=\"\">\n\n\n<h3>00 Fcfc 631099971 A 3548 E 42 B 1 Ce 4 Fd 0 D</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/3_x_3m_Pool_in_Northbridge_Sydney_by_Cronulla_Pools_Stone_Lotus_Landscapes_2__Image_by_Capture_Creative_w9ytfq.webp\" alt=\"\">\n\n\n<h3>3 X 3 M Pool In Northbridge Sydney By Cronulla Pools Stone Lotus Landscapes 2 Image By Capture Creative W 9 Ytfq</h3>\n\n\n<div><p><span>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/3-e1640146305177.webp\" alt=\"\">\n\n\n<h3>3 E 1640146305177</h3>\n\n\n<div><p>Even a water tank repurposed for use as a pool can help to reduce costs.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/004-Large-28.webp\" alt=\"\">\n\n\n<h3>004 Large 28</h3>\n\n\n<div><p>Any shape pool will do... even triangular!</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/8c5501ef1201718496bae2777fd48374.webp\" alt=\"\">\n\n\n<h3>8 C 5501 Ef 1201718496 Bae 2777 Fd 48374</h3>\n\n\n<div><p><span>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/270w12.webp\" alt=\"\">\n\n\n<h3>270 W 12</h3>\n\n\n<div><p>A pool situated in a courtyard may be an option.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/315ww15.webp\" alt=\"\">\n\n\n<h3>315 Ww 15</h3>\n\n\n<div><p><span>A pool situated in a courtyard may be an option.</span></p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/8130206ae734b86c9a795ac1ad27f84a.webp\" alt=\"\">\n\n\n<h3>8130206 Ae 734 B 86 C 9 A 795 Ac 1 Ad 27 F 84 A</h3>\n\n\n<div><p>A water tank repurposed for use as a pool can help to reduce costs.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/121076385_1192826167752854_6318633728477788241_n.webp\" alt=\"\">\n\n\n<h3>121076385 1192826167752854 6318633728477788241 N</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/Aerial%20shot%20of%20Plungie%20Arena%203.webp\" alt=\"\">\n\n\n<h3>Aerial Shot Of Plungie Arena 3</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/alderley-courtyard-define-landscape-architecture-img_c241059d0ddb3de1_9-5343-1-9334edc.webp\" alt=\"\">\n\n\n<h3>Alderley Courtyard Define Landscape Architecture Img C 241059 D 0 Ddb 3 De 1 9 5343 1 9334 Edc</h3>\n\n\n<div><p>The pool should be s