      <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/courtyard-design-house-plans.webp\" alt=\"\">\n\n\n<h3>Courtyard Design House Plans</h3>\n\n\n<div><p>We think this is fantastic! Private, stylish, small and beautiful.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/Delta-Plunge-Pools-Direct-Install-2-640x530.webp\" alt=\"\">\n\n\n<h3>Delta Plunge Pools Direct Install 2 640 X 530</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/extension-de-maison-mary-reille-architecture-d-interieur-img.webp\" alt=\"\">\n\n\n<h3>Extension De Maison Mary Reille Architecture D Interieur Img</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/FiMims240210_040.webp\" alt=\"\">\n\n\n<h3>Fi Mims 240210 040</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/fingal-oasis-aspect-architecture-img_f48184890eb3b264_9-2644-1-64b3a51.webp\" alt=\"\">\n\n\n<h3>Fingal Oasis Aspect Architecture Img F 48184890 Eb 3 B 264 9 2644 1 64 B 3 A 51</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/brief/pool/gallery/Tootgarook-January-2021-Image-2.webp\" alt=\"\">\n\n\n<h3>Tootgarook January 2021 Image 2</h3>\n\n\n<div><p>The pool should be small. Shape does not matter. We would like the pool to be a feature element.</p></div>\n\n\n    </li>\n        <li