ink_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"title_align\":\"top\",\"title_grid_width\":\"1-2\",\"title_grid_breakpoint\":\"m\",\"meta_element\":\"h4\",\"content_column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"item_animation\":true,\"title_style\":\"h5\"},\"children\":[{\"name\":\"\",\"type\":\"grid_item\",\"props\":{\"title\":\"Last Revised\"},\"source\":{\"query\":{\"name\":\"article\"},\"props\":{\"_condition\":{\"filters\":{\"condition\":\"!!\"},\"name\":\"publish_up\"},\"meta\":{\"filters\":{\"search\":\"\",\"date\":\"j F, Y\"},\"name\":\"modified\"}}}}]}]},{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"2-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p class=\\\"uk-text-lead\\\">We would like to incorporate a small plunge pool. The pool will be used for cooling off, relaxation and conversation after work. It won\\u2019t be used by children (no bombs) or for exercise\\/laps (the estate has two large community pools for this purpose).<\\/p>\\n<p>It\\u2019s important the pool is sited well and looks integral to the overall aesthetic of the building and not an \\u201cadd-on\\u201d that has been dropped into the\\u00a0site as an afterthought.<\\/p>\\n<p>We don\'t care of the pool is round, square or rectangular but it should be at least 1.5m deep. It can be in-ground, semi in-ground or fully above ground.\\u00a0<\\/p>\\n<p>We would like the pool to be incorporated as a feature element if possible and not tucked away into a corner. To this end, we would consider situating the pool within the main outdoor space or a central courtyard within the house.<\\/p>\\n<p>As far as we know, there is only one other property within the estate that has a private pool. We see the inclusion of a pool as a desirable feature that will add future buyer appeal to the home.<\\/p>\\n<p>If the overall project budget or space become an issue, we will consider removing the pool element.<\\/p>\"}},{\"type\":\"alert\",\"props\":{\"title_element\":\"h3\",\"alert_style\":\"primary\",\"title\":\"<i>Note<\\/i>\",\"content\":\"<p><i>The images\\u00a0in the gallery on this page illustrate features and elements\\u00a0of interest and do not necessarily represent the overall design style we are wanting to achieve.<\\/i><\\/p>\",\"content_margin\":\"remove\",\"title_inline\":true,\"alert_size\":true},\"name\":\"Alert\"}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab essential\",\"attributes\":\"tabtitle=\\\"Essential\\\"\",\"id\":\"essential\",\"padding_remove_top\":false,\"preserve_color\":false,\"overlap\":false,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"class\":\"essential\",\"width\":\"xsmall\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Essential\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Essential\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arr