(14, 77, 'Budget', 'budget', '<img src=\"/2-birdie-place/images/headers/title-bg-budget.svg\" alt=\"\">\n<h2>Budget</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">We have received guidence that our current funding capacity is around $1.2M. Based on recent sales, we anticipate the land at 2 Birdie Place would currently be conservatively valued at approximately $450K.</p></div>\n<ul>\n        <li>\n        <a href=\"https://www.domain.com.au/sold-listings/wyong-nsw-2259/?ptype=development-site,new-land,vacant-land&keywords=kooindah\">Recent Land Sales</a>\n    </li>\n        <li>\n        <a href=\"https://www.domain.com.au/sold-listings/wyong-nsw-2259/house/?bedrooms=4-any&keywords=kooindah\">Recent Home Sales</a>\n    </li>\n    </ul>\n<div><p>Whilst we intend to live in this home for many years and ultimately expect reasonable long-term capital growth, we are also mindful of over capitalising in what potentially may become a falling property market in the short-term creating a risky financial situation whereby the cost of the project exceeds the final completed value leaving us in a negative equity position.</p></div>\n<hr>\n<div>\n\n    \n        <h3>$800K + fees</h3>\n    \n        <p>Construction</p>\n    \n    \n    \n</div>\n<div>\n\n    \n        <h3>$30K</h3>\n    \n        <p>Pool</p>\n    \n    \n    \n</div>\n<div>\n\n    \n        <h3>$75K</h3>\n    \n        <p>Outdoor Spaces</p>\n    \n    \n    \n</div>\n<div>\n\n    \n        <h3>$75K</h3>\n    \n        <p>Additional Landscaping</p>\n    \n    \n    \n</div>\n<img src=\"/2-birdie-place/images/pages/budget/landing-page-living-room-01.jpg\" alt=\"\">\n<ul>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/budget/landing-page-living-room-02.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/budget/landing-page-living-room-03.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/2-birdie-place/images/pages/budget/landing-page-living-room-04.jpg\" alt=\"\">\n\n\n\n\n\n    </li>\n    </ul>\n<p>\n    <a href=\"index.php?Itemid=107\">Concept</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=108\">Specifications</a>\n</p>\n', '<!-- {\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-budget.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Budget Hero\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":true,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"column_gap\":\"large\",\"width\":\"large\"},\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-3\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"Headline\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Budget\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},