(15, 78, 'Specifications', 'specifications', '<img src=\"/images/headers/title-bg-specs.svg\" alt=\"\">\n<h2>Brief</h2>\n<div>\n\n    \n<h3>Last Revised</h3>\n\n\n\n\n</div>\n<div><p class=\"uk-text-lead\">Kooindah Waters Estate is primarily populated with project home contructions from various major builders. The houses are homogeneous in design and use of materials. Whilst we are not looking to achieve a design that wins awards, we are wanting a home that is not only functional but is also visually appealing and has an obviously different aesthetic from the other homes in the estate.</p>\n<p>As much as possible, we would like the home to take advantage of passive design to assist with heating &amp; cooling but are also looking to compliment this with additional amenities such as air conditioning when required.</p></div>\n<h2>Essential</h2>\n<ul>\n        <li>\n\n        \n<div>4 Bedrooms\n<ul>\n    <li>2 Master bedrooms</li>\n    <li>2 Additional bedrooms</li>\n    </ul></div>\n\n    </li>\n        <li>\n\n        \n<div>1 Main bathroom with bath</div>\n\n    </li>\n        <li>\n\n        \n<div>Powder room downstairs (if a double story design)</div>\n\n    </li>\n        <li>\n\n        \n<div>Private office space (not open plan/study nook)</div>\n\n    </li>\n        <li>\n\n        \n<div><p>Laundry space</p></div>\n\n    </li>\n        <li>\n\n        \n<div>2 Car garage with single door</div>\n\n    </li>\n        <li>\n\n        \n<div>Dedicated outdoor cooking/BBQ space</div>\n\n    </li>\n        <li>\n\n        \n<div>Outdoor living/green space(s)</div>\n\n    </li>\n        <li>\n\n        \n<div>Low maintenance interiors, exteriors and outdoor spaces</div>\n\n    </li>\n        <li>\n\n        \n<div>Reverse cycle air conditioning to bedrooms</div>\n\n    </li>\n        <li>\n\n        \n<div>Solar power generation and battery storage</div>\n\n    </li>\n        <li>\n\n        \n<div>Minimum of 2 GPOs in all rooms</div>\n\n    </li>\n        <li>\n\n        \n<div>Good lighting design</div>\n\n    </li>\n        <li>\n\n        \n<div>Well insulated</div>\n\n    </li>\n        <li>\n\n        \n<div>Good privacy - homes in the estate are close together and we do not want to feel like we are living in a birdcage</div>\n\n    </li>\n    </ul>\n<h2>Highly Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Steel frame to mitigate the risk of insect damage</div>\n\n    </li>\n        <li>\n\n        \n<div>Hard wearing attractive floor finishes - particularly like polished concrete or similar</div>\n\n    </li>\n        <li>\n\n        \n<div>If tiles are used for flooring, no grout lines to be visible</div>\n\n    </li>\n        <li>\n\n        \n<div>As quiet as is practical - we don’t want to live in an echo chamber</div>\n\n    </li>\n        <li>\n\n        \n<div>Additional garage space or annex to accommodate a motorbike or golf cart</div>\n\n    </li>\n        <li>\n\n        \n<div>Internal private courtyard</div>\n\n    </li>\n        <li>\n\n        \n<div>Living and sleeping spaces to be as far apart as possible e.g. 2 wings</div>\n\n    </li>\n        <li>\n\n        \n<div>Plunge pool</div>\n\n    </li>\n        <li>\n\n        \n<div>Outdoor fireplace and/or firepit</div>\n\n    </li>\n        <li>\n\n        \n<div>Storage for coats & shoes adjacent to main entry</div>\n\n    </li>\n        <li>\n\n        \n<div>Alcove or recess or space for a bench seat by main entry (for ease of putting shoes on/off)</div>\n\n    </li>\n        <li>\n\n        \n<div>Integration of low maintenance vegetation such as green walls and planted niches into design</div>\n\n    </li>\n        <li>\n\n        \n<div>Reverse cycle air conditioning to whole house</div>\n\n    </li>\n        <li>\n\n        \n<div>CAT7 cabling to all living spaces and bedrooms</div>\n\n    </li>\n        <li>\n\n        \n<div>Smart home automation</div>\n\n    </li>\n        <li>\n\n        \n<div>Electronic keyless access to main entry door</div>\n\n    </li>\n        <li>\n\n        \n<div>Dimmable lighting</div>\n\n    </li>\n    </ul>\n<h2>Desirable</h2>\n<ul>\n        <li>\n\n        \n<div>Freestanding office/garden studio</div>\n\n    </li>\n        <li>\n\n        \n<div>Master bedrooms not adjacent to secondary bedrooms</div>\n\n    </li>\n        <li>\n\n        \n<div>Rooftop alfresco space/garden or green roof</div>\n\n    </li>\n        <li>\n\n        \n<div>As much rainwater storage as is practical</div>\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <img src=\"/images/2-birdie-place/2014610600_1_1_180903_034951-w1600-h1200.jpeg\" alt=\"\">\n\n\n<h3>2014610600 1 1 180903 034951 W 1600 H 1200</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/images/2-birdie-place/2014610600_2_1_180903_034951-w1600-h1200.jpeg\" alt=\"\">\n\n\n<h3>2014610600 2 1 180903 034951 W 1600 H 1200</h3>\n\n\n\n\n    </li>\n        <li>\n\n        <img src=\"/images/2-birdie-place/2014610600_4_1_180903_034951-w1600-h1200.jpeg\" alt=\"\">\n\n\n<h3>2014610600 4 1 180903 034951 W 1600 H 1200</h3>\n\n\n\n\n    </li>\n    </ul>\n<h2>Utilities</h2>\n<div><p>We are open to discussion on what technoligies are used to achive various utility functions such as cooking, hot water, heating/cooling etc. Of course budget will be a major consideration but for the purposes of scoping and costings, we have listed our preferred options.</p>\n<p><em>Any appliances linked below represent examples only and are not necessarily the brand or model we have selected or intend to purchase.</em></p></div>\n<h2>Climate</h2>\n<div><p>It is our prefernce to use ceiling fans to circulate and move air around rooms before utilising power hungry appliances such as air conditioners - particularly in bedrooms.</p>\n<p>When stronger heating/cooling is required, we will use some form of air conditioning to the main living areas as well as the office and bedrooms. We are yet to decide if this will be a <a href=\"https://mhiaa.com.au/products/category/residential/ducted-systems/\" target=\"_blank\" rel=\"noopener noreferrer\">ducted system</a>, <a href=\"https://mhiaa.com.au/products/category/residential/split-systems/\" target=\"_blank\" rel=\"noopener noreferrer\">wall mounted split system</a>, <a href=\"https://mhiaa.com.au/products/category/residential/multi-split-systems/\" target=\"_blank\" rel=\"noopener noreferrer\">multi-unit split system</a> or <a href=\"https://mhiaa.com.au/products/category/residential/bulkhead-systems/\" target=\"_blank\" rel=\"noopener noreferrer\">bulkhead system</a>. As much as is possible, we would like the AC to be unobtrusive and are not fans of split systems that result in multiple compressor units outside the home and head units hanging on the inside of walls. Walls are for hanging pictures and holding up the roof, not displaying AC units!</p>\n<p>The primary drivers that will determine the final solution will be a balance of cost, space and sympathetic consideration of the house design.</p>\n<p>We are also considering the inclusion of underfloor heating. This may be to all living areas or only select rooms e.g. bedrooms &amp; bathrooms. There are a range of technologies and heating methods such as <a href=\"https://www.warmtech.com.au/getting-started/inslab-heating\" target=\"_blank\" rel=\"noopener noreferrer\">inslab</a>, <a href=\"https://www.warmtech.com.au/getting-started/inscreed-heating\" target=\"_blank\" rel=\"noopener noreferrer\">inscreed</a> or <a href=\"https://www.warmtech.com.au/getting-started/undercarpet-heating\" target=\"_blank\" rel=\"noopener noreferrer\">under carpet</a> available on the market and we are yet to decide if this is something we will proceed with. If budget or design constraints dictate, we would drop this feature.</p>\n<p>We would like to incorporate a fireplace within the main living area although this will be purely for aesthetics rather than as a regular functional heat source. The fireplace can be fueled with either <a href=\"https://www.escea.com/au/gas-fireplaces/ds-series/single-sided/\" target=\"_blank\" rel=\"noopener noreferrer\">mains gas</a> or <a href=\"https://ecosmartfire.com.au/product/flex-42ss/\" target=\"_blank\" rel=\"noopener noreferrer\">ethanol</a>. If space and/or cost considerations dictate, we would forego this appliance.</p></div>\n<h2>Cooking</h2>\n<div><p>We will use an <a href=\"https://www.miele.com.au/domestic/cooktops-and-combisets-2473.htm?mat=11503460&amp;name=KMDA_7634_FL\" target=\"_blank\" rel=\"noopener noreferrer\">electric induction stove with a built-in extractor</a> in the kitchen. This will negate the need for a rangehood and provide more flexability as to where the stove can be situated within the kitchen.</p>\n<p>The oven will be all electric.</p>\n<p>Ideally we would like the BBQ connected to mains gas as our first option but are happy to utilise bottled LPG if necessary.</p>\n<p>We will also use a <a href=\"https://www.auscrown.com.au/products/product/high-pressure-burner-hp200lpb\" target=\"_blank\" rel=\"noopener noreferrer\">commercial grade wok burner ring</a> near to the BBQ. Again connected to mains gas is the preference but this will also function fine on bottled LPG if required. This appliance will probably be free standing and not built-in.</p></div>\n<h2>Hot Water</h2>\n<div><p>We would prefer to use a <a href=\"https://www.stiebel-eltron.com.au/wwk-222-heat-pump\" target=\"_blank\" rel=\"noopener noreferrer\">Heat Pump</a> system for hot water as this will allow us to maximise the value of our solar system. We would also consider an instanaeous gas hot water system if necessary although there would need to be compelling reasons for doing so e.g. lack of space for the unit.</p></div>\n<h2>Renewables</h2>\n<div><p>We will install solar panels and compliment this with a battery storage system. The budget and available technologies may delay the purchase of the battery and at this stage, we are agnostic as to which type of storage system we will install. There should be enough solar panels to produce at least 8-10kW although the cost of panels is relatively low so we would like to install as many as is practical with an aim to storing the excess.</p>\n<p>We also plan to purchase EV\'s as our current vehicles reach end of life which is a further consideration for installing as much solar generation and storage capacity as is practical.</p>\n<p>We would also like to capture and store as much rain water as possible. We recognise that the relatively small size of our land will dicate how much space we are able to allocate to storage. With that in mind, we are considering solutions such as <a href=\"https://www.watertankfactory.com.au/types/underground-water-tanks/\" target=\"_blank\" rel=\"noopener noreferrer\">undergound</a> or <a href=\"https://www.aquacomb.com.au/\" target=\"_blank\" rel=\"noopener noreferrer\">under slab</a> tanks.</p></div>\n<p>\n    <a href=\"index.php?Itemid=129\">Budget</a>\n</p>\n<p>\n    <a href=\"index.php?Itemid=109\">Materials</a>\n</p>\n', '<!-- {\"name\":\"Concept\",\"type\":\"layout\",\"children\":[{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"image\":\"\",\"animation\":\"fade\",\"preserve_color\":false,\"image_effect\":\"fixed\",\"image_parallax_bgx_start\":\"-300\",\"image_parallax_bgx_end\":\"0\",\"animation_delay\":\"\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"vertical_align\":\"middle\",\"position_sticky_breakpoint\":\"m\",\"position_sticky\":false},\"children\":[{\"type\":\"image\",\"props\":{\"margin\":\"small\",\"image_svg_color\":\"\",\"image\":\"images\\/headers\\/title-bg-specs.svg\",\"image_svg_inline\":false,\"text_align\":\"center\",\"image_svg_animate\":false}}]}],\"props\":{\"margin\":\"remove-vertical\"}}],\"name\":\"Specifications Hero\"},{\"name\":\"Details\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_bottom\":true,\"animation_delay\":false,\"animation\":\"fade\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"vertical_align\":false},\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"1-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Brief\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"grid\",\"props\":{\"show_title\":true,\"show_meta\":true,\"show_content\":true,\"show_image\":true,\"show_link\":true,\"grid_default\":\"1\",\"grid_medium\":\"1\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"image_align\":\"top\",\"image_grid_width\":\"1-2\",\"link_text\":\"Visit Page\",\"link_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"title_align\":\"top\",\"title_grid_width\":\"1-2\",\"title_grid_breakpoint\":\"m\",\"meta_element\":\"h4\",\"content_column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"item_animation\":true,\"title_style\":\"h5\"},\"children\":[{\"name\":\"\",\"type\":\"grid_item\",\"props\":{\"title\":\"Last Revised\"},\"source\":{\"query\":{\"name\":\"article\"},\"props\":{\"_condition\":{\"filters\":{\"condition\":\"!!\"},\"name\":\"publish_up\"},\"meta\":{\"filters\":{\"search\":\"\",\"date\":\"j F, Y\"},\"name\":\"modified\"}}}}]}]},{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"2-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p class=\\\"uk-text-lead\\\">Kooindah Waters Estate is primarily populated with project home contructions\\u00a0from various major builders. The houses are homogeneous in design and use of materials. Whilst we are not looking to achieve a design that wins awards, we are wanting a home that is not only functional but is also visually appealing and\\u00a0has an obviously different aesthetic from the other homes in the estate.<\\/p>\\n<p>As much as possible, we would like\\u00a0the home to take advantage of passive design to assist with heating &amp; cooling but are also looking to compliment this with additional amenities such as air conditioning when required.<\\/p>\"}}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-1 essential\",\"attributes\":\"tabtitle=\\\"Essential\\\"\",\"padding_remove_top\":false,\"preserve_color\":false,\"overlap\":false,\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"props\":{\"class\":\"essential\",\"width\":\"small\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Essential\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Essential\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\",\"column\":\"1-2\"},\"children\":[{\"type\":\"list_item\",\"props\":{\"content\":\"4 Bedrooms\\n<ul>\\n    <li>2 Master bedrooms<\\/li>\\n    <li>2 Additional bedrooms<\\/li>\\n    <\\/ul>\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"1 Main bathroom with bath\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Powder room downstairs (if a double story design)\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Private office space (not open plan\\/study nook)\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"<p>Laundry space<\\/p>\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"2 Car garage with single door\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Dedicated outdoor cooking\\/BBQ space\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Outdoor living\\/green space(s)\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Low maintenance interiors, exteriors and outdoor spaces\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Reverse cycle air conditioning to bedrooms\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Solar power generation and battery storage\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Minimum of 2 GPOs in all rooms\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Good lighting design\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Well insulated\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Good privacy - homes in the estate are close together and we do not want to feel like we are living in a birdcage\"}}]}]}]}],\"name\":\"Essential\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_positi