or fireplace and\\/or firepit\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Storage for coats & shoes adjacent to main entry\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Alcove or recess or space for a bench seat by main entry (for ease of putting shoes on\\/off)\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Integration of low maintenance vegetation such as green walls and planted niches into design\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Reverse cycle air conditioning to whole house\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"CAT7 cabling to all living spaces and bedrooms\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Smart home automation\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Electronic keyless access to main entry door\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Dimmable lighting\"}}]}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Highly Desirable\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-1 desirable\",\"attributes\":\"tabtitle=\\\"Desirable\\\"\",\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Desirable\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Desirable\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"name\":\"\",\"type\":\"list\",\"props\":{\"show_image\":true,\"show_link\":true,\"image_align\":\"left\",\"margin\":\"medium\",\"content_style\":null,\"list_size\":\"\",\"list_element\":\"ul\",\"column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"image_vertical_align\":false,\"icon\":\"arrow-right\",\"list_type\":\"vertical\",\"list_horizontal_separator\":\", \",\"icon_width\":\"30\",\"column\":\"1-2\"},\"children\":[{\"type\":\"list_item\",\"props\":{\"content\":\"Freestanding office\\/garden studio\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Master bedrooms not adjacent to secondary bedrooms\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"Rooftop alfresco space\\/garden or green roof\"}},{\"type\":\"list_item\",\"props\":{\"content\":\"As much rainwater storage as is practical\"}}]}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Desirable\"},{\"name\":\"Gallery\",\"type\":\"section\",\"props\":{\"style\":\"secondary\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding\":\"small\",\"padding_remove_bottom\":false,\"animation_delay\":false,\"padding_remove_top\":false,\"preserve_color\":false},\"children\":[{\"name\":\"\",\"type\":\"row\",\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_medium\":\"1-1\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"gallery\",\"props\":{\"show_title\":false,\"show_meta\":false,\"show_content\":true,\"show_link\":false,\"show_hover_image\":false,\"grid_default\":\"1\",\"grid_medium\":\"3\",\"overlay_mode\":\"cover\",\"overlay_hover\":true,\"overlay_style\":\"overlay-default\",\"text_color\":\"light\",\"overlay_position\":\"center\",\"overlay_transition\":\"fade\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"text_align\":\"center\",\"margin\":\"default\",\"image_width\":\"640\",\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"overlay_link\":true,\"link_text\":\"\",\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"meta_element\":\"div\",\"link_style\":\"default\",\"item_animation\":true,\"grid_masonry\":true,\"lightbox\":true,\"lightbox_image_orientation\":true,\"title_display\":\"item\",\"grid_parallax\":\"\",\"overlay_transition_background\":false,\"filter\":false,\"content_display\":\"lightbox\",\"animation\":\"fade\"},\"children\":[{\"type\":\"gallery_item\",\"props\":{\"title\":\"2014610600 1 1 180903 034951 W 1600 H 1200\",\"image\":\"images\\/2-birdie-place\\/2014610600_1_1_180903_034951-w1600-h1200.jpeg\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2014610600 2 1 180903 034951 W 1600 H 1200\",\"image\":\"images\\/2-birdie-place\\/2014610600_2_1_180903_034951-w1600-h1200.jpeg\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2014610600 4 1 180903 034951 W 1600 H 1200\",\"image\":\"images\\/2-birdie-place\\/2014610600_4_1_180903_034951-w1600-h1200.jpeg\"}}]}]}],\"props\":{\"margin_remove_top\":false}}]},{\"name\":\"Utilities\",\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_bottom\":true,\"animation_delay\":false,\"animation\":\"fade\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"props\":{\"layout\":\"1-3,2-3\",\"vertical_align\":false},\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"1-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Utilities\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}}]},{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_small\":\"2-3\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>We are open to discussion on what technoligies are used to achive various utility functions such as cooking, hot water, heating\\/cooling etc. Of course budget will be a major consideration but for the purposes of scoping and costings, we have listed our preferred options.<\\/p>\\n<p><em>Any\\u00a0appliances linked below represent examples only and are not necessarily the brand or model we have selected or intend to purchase.<\\/em><\\/p>\"}}]}]}]},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-2 climate\",\"attributes\":\"tabtitle=\\\"Climate\\\"\",\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Climate\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Climate\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>It is our prefernce to use ceiling fans to circulate and move air around rooms before utilising power hungry appliances such as air conditioners - particularly in bedrooms.<\\/p>\\n<p>When stronger heating\\/cooling is required, we will use some form of air conditioning to the main living areas as well as the office and bedrooms. We are yet to decide if this\\u00a0will be a <a href=\\\"https:\\/\\/mhiaa.com.au\\/products\\/category\\/residential\\/ducted-systems\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">ducted system<\\/a>, <a href=\\\"https:\\/\\/mhiaa.com.au\\/products\\/category\\/residential\\/split-systems\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">wall mounted split system<\\/a>, <a href=\\\"https:\\/\\/mhiaa.com.au\\/products\\/category\\/residential\\/multi-split-systems\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">multi-unit split system<\\/a> or <a href=\\\"https:\\/\\/mhiaa.com.au\\/products\\/category\\/residential\\/bulkhead-systems\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">bulkhead system<\\/a>. As much as is possible, we would like the AC to be unobtrusive and are not fans of split systems that result in multiple compressor units outside the home and head units hanging on the inside of walls. Walls are for hanging pictures and holding up the roof, not displaying AC units!<\\/p>\\n<p>The primary drivers that will determine the final solution will be a balance of cost, space and sympathetic consideration of the house design.<\\/p>\\n<p>We are also considering the\\u00a0inclusion of underfloor heating. This may be to all living areas or only select rooms e.g. bedrooms &amp; bathrooms. There are a range of technologies and heating methods such as <a href=\\\"https:\\/\\/www.warmtech.com.au\\/getting-started\\/inslab-heating\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">inslab<\\/a>, <a href=\\\"https:\\/\\/www.warmtech.com.au\\/getting-started\\/inscreed-heating\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">inscreed<\\/a> or <a href=\\\"https:\\/\\/www.warmtech.com.au\\/getting-started\\/undercarpet-heating\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">under carpet<\\/a> available on the market and we are yet to decide if this is something we will proceed with. If budget or design constraints dictate, we would drop this feature.<\\/p>\\n<p>We would like to incorporate a fireplace within the main living area although this will be purely for aesthetics rather than as a\\u00a0regular functional heat source. The fireplace can be fueled with either <a href=\\\"https:\\/\\/www.escea.com\\/au\\/gas-fireplaces\\/ds-series\\/single-sided\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">mains gas<\\/a> or <a href=\\\"https:\\/\\/ecosmartfire.com.au\\/product\\/flex-42ss\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">ethanol<\\/a>. If space and\\/or cost considerations dictate, we would forego this appliance.<\\/p>\"}}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Climate\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-2 cooking\",\"attributes\":\"tabtitle=\\\"Cooking\\\"\",\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Climate\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Cooking\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>We will use an <a href=\\\"https:\\/\\/www.miele.com.au\\/domestic\\/cooktops-and-combisets-2473.htm?mat=11503460&amp;name=KMDA_7634_FL\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">electric induction stove with a built-in extractor<\\/a> in the kitchen. This will negate the need for a rangehood and provide more flexability as to where the stove can be situated within the kitchen.<\\/p>\\n<p>The oven will be all electric.<\\/p>\\n<p>Ideally we would like the BBQ connected to mains gas as our first option but are happy to utilise bottled LPG if necessary.<\\/p>\\n<p>We\\u00a0will also\\u00a0use a <a href=\\\"https:\\/\\/www.auscrown.com.au\\/products\\/product\\/high-pressure-burner-hp200lpb\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">commercial grade wok burner ring<\\/a> near to the BBQ. Again connected to mains gas is the preference but this will also function fine on bottled LPG if required. This appliance will probably be free standing and not built-in.<\\/p>\"}}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Cooking\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-2 hot-water\",\"attributes\":\"tabtitle=\\\"Hot Water\\\"\",\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Climate\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Hot Water\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>We would prefer to use a <a href=\\\"https:\\/\\/www.stiebel-eltron.com.au\\/wwk-222-heat-pump\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">Heat Pump<\\/a> system for hot water as this will allow us to maximise the\\u00a0value of our solar system. We would\\u00a0also consider an instanaeous gas hot water system if necessary although there would need to be compelling reasons for doing so e.g. lack of space for the unit.<\\/p>\"}}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Hot Water\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"class\":\"bgm-tab-2 renewables\",\"attributes\":\"tabtitle=\\\"Renewables\\\"\",\"animation\":\"fade\"},\"children\":[{\"type\":\"row\",\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\"},\"children\":[{\"name\":\"Headline - Renewables\",\"type\":\"headline\",\"props\":{\"title_element\":\"h2\",\"content\":\"Renewables\",\"title_decoration\":\"bullet\",\"title_style\":\"h1\",\"class\":\"\"}},{\"type\":\"text\",\"props\":{\"margin\":\"default\",\"column_breakpoint\":\"m\",\"content\":\"<p>We will install solar panels and compliment this with a battery storage system. The budget and available technologies may delay the purchase of the battery and at this stage, we are agnostic as to which type of storage system we will install. There should be enough solar panels to produce at least 8-10kW although the cost of panels is relatively low so we would like to install as many as is practical with an aim to storing the excess.<\\/p>\\n<p>We also plan to purchase EV\'s as our current vehicles reach end of life which is a further consideration for installing as much solar generation and storage capacity as is practical.<\\/p>\\n<p>We would also like to capture and store as much rain water as possible. We recognise that the relatively small size of our land will dicate how much space we are able to allocate to storage. With that in mind, we are considering solutions such as <a href=\\\"https:\\/\\/www.watertankfactory.com.au\\/types\\/underground-water-tanks\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">undergound<\\/a> or <a href=\\\"https:\\/\\/www.aquacomb.com.au\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">under slab<\\/a> tanks.<\\/p>\"}}]}],\"props\":{\"width\":\"small\"}}],\"name\":\"Renewables\"},{\"type\":\"section\",\"props\":{\"style\":\"default\",\"width\":\"default\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding_remove_top\":false,\"id\":\"pagination\"},\"children\":[{\"type\":\"row\",\"props\":{\"layout\":\"1-2,1-2\"},\"children\":[{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"right\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"left\",\"content\":\"Budget\",\"link\":\"index.php?Itemid=129\",\"icon\":\"chevron-left\"}}],\"name\":\"Previous\"}]},{\"type\":\"column\",\"props\":{\"position_sticky_breakpoint\":\"m\",\"image_position\":\"center-center\",\"media_overlay_gradient\":\"\",\"width_medium\":\"1-2\",\"width_default\":\"1-2\"},\"children\":[{\"type\":\"button\",\"props\":{\"grid_column_gap\":\"small\",\"grid_row_gap\":\"small\",\"margin\":\"default\",\"text_align\":\"left\"},\"children\":[{\"type\":\"button_item\",\"props\":{\"button_style\":\"\",\"icon_align\":\"right\",\"content\":\"Materials\",\"link\":\"index.php?Itemid=109\",\"icon\":\"chevron-right\"}}],\"name\":\"Next\"}]}]}],\"name\":\"Pagination\"}],\"version\":\"2.7.22\"} -->', 1, 2, '2022-04-17 03:18:40', 718, '', '2022-06-26 10:20:27', 718, 0, '0000-00-00 00:00:00', '2022-04-17 03:18:40', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 63, 13, '', '', 1, 1592, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
