\":\"This is fantsastic! Concrete, brick, steel and glass all combined with some wonderful landscape design. Love the grass cascading down to street level like a living river. There\'s even boulders in the stream!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Garcias House Warm Architects Concrete Interiors Dezeen Col\",\"image\":\"images\\/pages\\/materials\\/gallery\\/garcias-house-warm-architects-concrete-interiors-dezeen-col.webp\",\"content\":\"Like the continuation of the concrete floor into the stairs.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Glo Eco Home Green Roof 05 3 2\",\"image\":\"images\\/pages\\/materials\\/gallery\\/glo-eco-home-green-roof-05_3-2.webp\",\"content\":\"Love buildings that incorporate vegetation into the aesthetic. Plants provide visual interest and appeal, can help to soften hard edges and can deliver positive insulating and environmental outcomes.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Gosford Quarries Sandstone Suppliers Sandstone 2011 HIA Home Year Mt White Brown Range Gang Sawn Cladding\",\"image\":\"images\\/pages\\/materials\\/gallery\\/gosford-quarries-sandstone-suppliers-sandstone-2011-HIA-Home-Year-Mt-White-Brown-Range-Gang-Sawn-Cladding.webp\",\"content\":\"Really like the sandstone cladding.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Hill House Mihaly Slocombe Img A 7 D 1 B 56900 Ee 3 B 8 A 9 2918 1 3 A 11456\",\"image\":\"images\\/pages\\/materials\\/gallery\\/hill-house-mihaly-slocombe-img_a7d1b56900ee3b8a_9-2918-1-3a11456.webp\",\"content\":\"Like the use of corrugated steel.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Image 2\",\"image\":\"images\\/pages\\/materials\\/gallery\\/Image-2.webp\",\"content\":\"Really like this used of mixed materials, steel (aluminium?) cladding, timber and sandstone. Love how the hard box shapes have been softened through the use of vegetation.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"IMG 5980 Edit\",\"image\":\"images\\/pages\\/materials\\/gallery\\/IMG_5980-Edit.webp\",\"content\":\"What a fantastic rooftop garden!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Large\",\"image\":\"images\\/pages\\/materials\\/gallery\\/large.webp\",\"content\":\"Love this - especially the upstairs balcony that takes advantage of the greened roof. Also like the sliding adjustable louvres that provide privacy and climate control.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Manning Road House Noxon Giffen Img F 31153 E 80403 Cf 1 D 9 3026 1 05 Fa 772\",\"image\":\"images\\/pages\\/materials\\/gallery\\/manning-road-house-noxon-giffen-img_f31153e80403cf1d_9-3026-1-05fa772.webp\",\"content\":\"Like this combination of timber and steel cladding.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Matthew Woodward Architecture Wallis Lake House 000004\",\"image\":\"images\\/pages\\/materials\\/gallery\\/MatthewWoodwardArchitecture_WallisLakeHouse_000004.webp\",\"content\":\"Love the use of concrete. Love the use of vegetation.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"2016546761 13 1 201012 120310 W 2392 H 1062\",\"image\":\"images\\/pages\\/materials\\/gallery\\/2016546761_13_1_201012_120310-w2392-h1062.webp\",\"content\":\"Absolutely love this. So many elements and materials that appeal - the brutal concrete, the weathered timber, large openings and plants integrated into the home\'s form.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Splash Back Tile Outset Design Medium Brown Sawn Cladding\",\"image\":\"images\\/pages\\/materials\\/gallery\\/splash+back+tile+outset_design+Medium+Brown+Sawn+Cladding.webp\",\"content\":\"Interesting use of sandstone as a splashback in the kitchen. Like when matrials are used in unusual or unexpected contexts.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Mid Century Modern 10 Matt Gibson\",\"image\":\"images\\/pages\\/materials\\/gallery\\/Mid-Century-Modern-10.-Matt-Gibson.webp\",\"content\":\"Really like the mid-century modern style and the use of timber materials.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"MLF 21 Woodwood Carlotta St 00067 Arnold Standard Thumb Medium 1000 X 989\",\"image\":\"images\\/pages\\/materials\\/gallery\\/MLF21_Woodwood_CarlottaSt_00067-arnold-standard-thumb-medium-1000x989.webp\",\"content\":\"Steel, concrete, timber and glass... love it all. Really like the planted awning too!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Nha Trang House By VTN Lead\",\"image\":\"images\\/pages\\/materials\\/gallery\\/Nha-Trang-house-by-VTN-lead.webp\",\"content\":\"A terraced roof garden!\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Northcote Residence 02 Feature\",\"image\":\"images\\/pages\\/materials\\/gallery\\/NorthcoteResidence02-feature.webp\",\"content\":\"Love polished concrete floors.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Polished Concrete Brisbane Ozgrind Kitchen Home\",\"image\":\"images\\/pages\\/materials\\/gallery\\/polished-concrete-brisbane-ozgrind-kitchen-home.webp\",\"content\":\"Love polished concrete floors.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Riverside Dr House Lachlan Shepherd Architects Img Aed 1109 C 0580 Ad 0 A 9 6013 1 45 D 0 Dfd\",\"image\":\"images\\/pages\\/materials\\/gallery\\/riverside-dr-house-lachlan-shepherd-architects-img_aed1109c0580ad0a_9-6013-1-45d0dfd.webp\",\"content\":\"Nice mix of materials.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Maxresdefault\",\"image\":\"images\\/pages\\/materials\\/gallery\\/maxresdefault.webp\",\"content\":\"Love the industrial look of the concrete rendered brick. The succulent themed landscaping compliments this very well.\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"South Coast House Acacia Joinery Pty Ltd Img 7611609904 E 68594 9 1713 1 3 Baa 513\",\"image\":\"images\\/pages\\/materials\\/gallery\\/south-coast-house-acacia-joinery-pty-ltd-img_7611609904e68594_9-1713-1-3baa513.webp\",\"content\":\"Like the weathered s