{\"type\":\"gallery_item\",\"props\":{\"title\":\"10 Walk In Shower Ideas Decorsnob\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/10-walk-in-shower-ideas-decorsnob.webp\",\"content\":\"<p>Like the bold use of colour as a feature and half walls separating the shower from the rest of the bathroom<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"13 Walk In Shower Ideas Decorsnob 1024 X 791\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/13-walk-in-shower-ideas-decorsnob-1024x791.webp\",\"content\":\"<p>Like the shower area is on the reverse of a central wall. Don\'t want a bath in the ensuite but a vanity would be well placed in this position instead<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"32 Walk In Shower Ideas Decorsnob\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/32-walk-in-shower-ideas-decorsnob.webp\",\"content\":\"<p>Love the use of concrete and the window. Like the idea of having a bench in the shower area but not convonced wood would wear well in such a wet and humid environment.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"39 Walk In Shower Ideas Decorsnob\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/39-walk-in-shower-ideas-decorsnob.webp\",\"content\":\"<p>Like the skylight over the shower area, large niche and long vanity with double sink and big drawers<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"44 Walk In Shower Ideas Decorsnob\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/44-walk-in-shower-ideas-decorsnob.webp\",\"content\":\"<p><span>Like the\\u00a0double entry and minimal use of (frameless) glass<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"049 E 73 A 452 E 26 E 533 Caafdebc 6 D 0843 F\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/049e73a452e26e533caafdebc6d0843f.webp\",\"content\":\"<p>Like the concrete and interesting skylight<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"1615346577445 16112025382435\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/1615346577445_16112025382435.webp\",\"content\":\"<p>Love the aggregate floor, long shelf in the shower and great natural light<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"1615350382696 1603689494849 BULLECOURTMOSMAN 19571\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/1615350382696_1603689494849BULLECOURTMOSMAN19571.webp\",\"content\":\"<p>Love the dual shower heads and skylight over the shower area<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"1641443324811 Bathroom Bathtub\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/1641443324811_bathroom-bathtub.webp\",\"content\":\"<p>Good natural light over the vanity area. Love the large shower area with dual shower heads and no doors or glass<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"1643766599883 2 Ensuite\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/1643766599883_2-Ensuite.webp\",\"content\":\"<p>Like the good natural light from the window and skylight<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Betonowa Lazienka Mikrocement 05\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/betonowa-\\u0142azienka-mikrocement05.webp\",\"content\":\"<p>Love the thick, heavy-set concrete bench and integrated sink.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Betonowa Lazienka Mikrocement 06\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/betonowa-\\u0142azienka-mikrocement06.webp\",\"content\":\"<p>Like the use of concrete and the doorless shower. Good natural light from the large window<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 02 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-02-1-Kindesign.webp\",\"content\":\"<p>Like the use of concrete and interesting full length skylight.\\u00a0Wouldn\'t want a timber floor in a bathroom at all though<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 10 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-10-1-Kindesign.webp\",\"content\":\"<p>Love the concrete bench with dual integrated sinks. Recessing the vanity into the wall is interesting<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 12 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-12-1-Kindesign.webp\",\"content\":\"<p>Love the concrete, especially the large heavy-set bench and integrated sink. Great natural light in the shower area<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 14 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-14-1-Kindesign.webp\",\"content\":\"<p>Like the use of concrete,\\u00a0the large skylight over the shower and the ledge seat with shower overhead<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 16 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-16-1-Kindesign.webp\",\"content\":\"<p>Love the large skylight, big windows, concrete bench with twin sinks, dual shower heads and large shower niche. Don\'t like the timber floor in the shower<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Concrete Bathroom Designs 19 1 Kindesign\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Concrete-Bathroom-Designs-19-1-Kindesign.webp\",\"content\":\"<p>Like the skylight placed directly over the large concrete vanity<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 01\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-01.webp\",\"content\":\"<p>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0Would\\u00a0come in handy\\u00a0as we age too no doubt.<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 02\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-02.webp\",\"content\":\"<p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0<\\/span><span>Would<\\/span><span>\\u00a0come in handy<\\/span><span>\\u00a0as we age too no doubt.<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 03\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-03.webp\",\"content\":\"<p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0<\\/span><span>Would<\\/span><span>\\u00a0come in handy<\\/span><span>\\u00a0as we age too no doubt.<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 04\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-04.webp\",\"content\":\"<p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0<\\/span><span>Would<\\/span><span>\\u00a0come in handy<\\/span><span>\\u00a0as we age too no doubt.<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 05\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-05.webp\",\"content\":\"<p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0<\\/span><span>Would<\\/span><span>\\u00a0come in handy<\\/span><span>\\u00a0as we age too no doubt.<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Seat 06\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/shower-seat-06.webp\",\"content\":\"<p><span>Like the idea of a bench or seat in the shower area. Nice to be able to sit under the falling water.\\u00a0<\\/span><span>Would<\\/span><span>\\u00a0come in handy<\\/span><span>\\u00a0as we age too no doubt.<\\/span><\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Shower Ledge Design Sky Window\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/Shower_Ledge_design_sky_window.webp\",\"content\":\"<p>Like the large skylight in the shower and use of a ledge (instead of a niche)<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Stanford University Klopf Architecture Mid Century Home Dezeen\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/stanford-university-klopf-architecture-mid-century-home_dezeen.webp\",\"content\":\"<p>Good natural light and large niche in the doorless shower<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Straw Bale House Sarah Wigglesworth Refurb Architecture Uk Dezeen\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/straw-bale-house-sarah-wigglesworth-refurb-architecture-uk_dezeen.webp\",\"content\":\"<p>Like the doorless design of the shower. Don\'t like the dingy lighting<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"Zip Litibu Palma House Mexico Dezeen 1704 Col 9\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/zip-litibu-palma-house-mexico_dezeen_1704_col_9.webp\",\"content\":\"<p>Like the use of concrete and the large external door\\u00a0providing natural light<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"412 N 20\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/412n20.webp\",\"content\":\"<p><em>LOVE<\\/em> the shower opening up onto a private outdoor space<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"483 W 25\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/483w25.webp\",\"content\":\"<p>Good natural light in the shower. Like the use of a central wall with the shower on the reverse side of the sinks<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"529 W 20\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/529w20.webp\",\"content\":\"<p>Good natural light and ventilation in the shower<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"570 W 32\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/570w32.webp\",\"content\":\"<p>Like the good light and ventilation from the large windows and\\u00a0louvres<\\/p>\"}},{\"type\":\"gallery_item\",\"props\":{\"title\":\"570 W 34\",\"image\":\"images\\/pages\\/brief\\/master-suites\\/gallery\\/ensuite\\/570W34.webp\",\"content\":\"<p>Like natural light and ventilation is the doorless shower with frameless glass<\\/p>\"}}]}]}],\"props\":{\"width\":\"expand\",\"column_gap\":\"collapse\",\"margin\":\"default\"}}],\"modified\":\"2022-04-18T04:10:44.946Z\",\"version\":\"2.7.21\"},\"m4ec3an5\":{\"name\":\"2\",\"type\":\"section\",\"props\":{\"style\":\"secondary\",\"width\":\"\",\"vertical_align\":\"middle\",\"title_position\":\"top-left\",\"title_rotation\":\"left\",\"title_breakpoint\":\"xl\",\"image_position\":\"center-center\",\"padding\":\"small\",\"padding_remove_bottom\":false,\"animation_delay\":false,\"padding_remove_top\":false,\"preserve_color\":false,\"status\":\"disabled\"},\"children\":[{\"name\":\"\",\"type\":\"row\",\"children\":[{\"name\":\"\",\"type\":\"column\",\"props\":{\"image_position\":\"center-center\",\"width_medium\":\"1-1\",\"media_overlay_gradient\":\"\",\"position_sticky_breakpoint\":\"m\"},\"children\":[{\"name\":\"\",\"type\":\"gallery\",\"props\":{\"show_title\":false,\"show_meta\":false,\"show_content\":true,\"show_link\":false,\"show_hover_image\":false,\"grid_default\":\"1