spend time together.<\\/p>\\n<p>We often spend many hours preparing large quantities of food. The kitchen needs to provide enough space to accommodate this comfortably without clutter.<\\/p>\\n<p>We cook and eat a lot outside throughout the year and would like the kitchen to be \\u201clinked\\u201d to the garden\\u00a0and flow into the outdoor space, either via fold-away doors opening up directly onto the outdoor kitchen and\\/or by way of a large servery window with a counter.<\\/p>\"}}]}]}],\"modified\":\"2022-06-26T05:35:28.749Z\",\"version\":\"2.7.22\"},\"-ta9Kvoh\":{\"name\":\"Modified\",\"type\":\"grid\",\"props\":{\"show_title\":true,\"show_meta\":true,\"show_content\":true,\"show_image\":true,\"show_link\":true,\"grid_default\":\"1\",\"grid_medium\":\"1\",\"title_element\":\"h3\",\"meta_style\":\"meta\",\"meta_align\":\"below-title\",\"image_align\":\"top\",\"image_grid_width\":\"1-2\",\"link_text\":\"Visit Page\",\"link_style\":\"\",\"margin\":\"default\",\"meta_margin\":\"remove\",\"item_maxwidth\":\"xlarge\",\"image_grid_breakpoint\":\"m\",\"icon_width\":80,\"filter_style\":\"tab\",\"filter_all\":true,\"filter_position\":\"top\",\"filter_align\":\"left\",\"filter_grid_width\":\"auto\",\"filter_grid_breakpoint\":\"m\",\"title_hover_style\":\"reset\",\"title_align\":\"top\",\"title_grid_width\":\"1-2\",\"title_grid_breakpoint\":\"m\",\"meta_element\":\"h4\",\"content_column_breakpoint\":\"m\",\"image_svg_color\":\"emphasis\",\"item_animation\":true,\"title_style\":\"h5\"},\"children\":[{\"name\":\"\",\"type\":\"grid_item\",\"props\":{\"title\":\"Last Revised\"},\"source\":{\"query\":{\"name\":\"article\"},\"props\":{\"_condition\":{\"filters\":{\"condition\":\"!!\"},\"name\":\"publish_up\"},\"meta\":{\"filters\":{\"search\":\"\",\"date\":\"j F, Y\"},\"name\":\"modified\"}}}}],\"modified\":\"2022-06-27T08:37:25.338Z\",\"version\":\"2.7.22\"}}}', '', 0, '0000-00-00 00:00:00', 0, 0);
