(196, 'COM_ADMIN_POSTINSTALL_MSG_BEHIND_LOAD_BALANCER_ACTION', 'Enable Behind Load Balancer Setting', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_admin.ini'),
(197, 'COM_ADMIN_POSTINSTALL_MSG_BEHIND_LOAD_BALANCER_DESCRIPTION', '<p>For Joomla sites hosted behind Load Balancers and Reverse Proxies a new Global Configuration setting has been introduced with Joomla 3.9.26</p><p>This setting, when enabled, will allow your Load Balancer/Reverse Proxy to provide the real IP address of your visitors. This IP will then be used in your Action Logs and used for tracking voting on articles (if these features are enabled).</p><p><strong>Only sites behind a Load Balancer/Reverse Proxy will wish to enable this feature.</strong></p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_admin.ini'),
(198, 'COM_ADMIN_POSTINSTALL_MSG_BEHIND_LOAD_BALANCER_TITLE', 'New Server Setting \"Behind Load Balancer\"', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_admin.ini'),
(199, 'COM_ADMIN_POSTINSTALL_MSG_HTACCESS_AUTOINDEX_DESCRIPTION', '<p>Before 3.9.22 the default htaccess.txt file contained erroneous code meant for disabling directory listings. The security team recommends to manually apply the necessary changes to any existing .htaccess file, as this file can not be updated automatically.</p><p>The old code:</p><pre>&lt;IfModule autoindex&gt;\\n  IndexIgnore *\\n&lt;/IfModule&gt;</pre><p>The new code:</p><pre>&lt;IfModule mod_autoindex.c&gt;\\n  IndexIgnore *\\n&lt;/IfModule&gt;</pre>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_admin.ini'),
(200, 'COM_ADMIN_POSTINSTALL_MSG_HTACCESS_AUTOINDEX_TITLE', '.htaccess Update Concerning Directory Listings', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_admin.ini'),
