(1648, 'COM_CPANEL_MESSAGES_BODYMORE_NOCLOSE', 'This information area won\'t appear when you have hidden all the messages.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1649, 'COM_CPANEL_MESSAGES_REVIEW', 'Read Messages', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1650, 'COM_CPANEL_MESSAGES_TITLE', 'You have post-installation messages', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1651, 'COM_CPANEL_MSG_ADDNOSNIFF_BODY', '<p>Joomla is now shipped with additional security hardenings in the default htaccess.txt and web.config.txt files. These hardenings disable the so called MIME-type sniffing feature in web browsers. The sniffing leads to specific attack vectors, where scripts in normally harmless file formats (eg images) will be executed, leading to Cross-Site-Scripting vulnerabilities.</p><p>The security team recommends to manually apply the necessary changes to existing .htaccess or web.config files, as those files can not be updated automatically.</p><p><strong>Changes for .htaccess</strong><br />Add the following lines before \"## Mod_rewrite in use.\":</p><pre>&lt;IfModule mod_headers.c&gt;\\nHeader always set X-Content-Type-Options \"nosniff\"\\n&lt;/IfModule&gt;</pre><p><strong>Changes for web.config</strong><br />Add the following lines right after \"&lt;/rewrite&gt;\":</p><pre>&lt;httpProtocol&gt;\\n  &lt;customHeaders&gt;\\n    &lt;add name=\"X-Content-Type-Options\" value=\"nosniff\" /&gt;\\n  &lt;/customHeaders&gt;\\n&lt;/httpProtocol&gt;</pre>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1652, 'COM_CPANEL_MSG_ADDNOSNIFF_TITLE', '.htaccess & web.config Security Update', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1653, 'COM_CPANEL_MSG_EACCELERATOR_BODY', 'eAccelerator is not compatible with Joomla! By selecting the Change to File Caching button below we will change the cache handler to file. If you want to use a different cache handler, please change it in the Global Configuration page.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1654, 'COM_CPANEL_MSG_EACCELERATOR_BUTTON', 'Change to File.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1655, 'COM_CPANEL_MSG_EACCELERATOR_TITLE', 'eAccelerator is not compatible with Joomla!', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1656, 'COM_CPANEL_MSG_HTACCESS_BODY', 'A change to the default .htaccess and web.config files was made in Joomla! 3.4 to disallow folder listings by default.  Users are recommended to implement this change in their files.  Please see <a href=\"https://docs.joomla.org/Special:MyLanguage/Preconfigured_htaccess\">this page</a> for more information.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1657, 'COM_CPANEL_MSG_HTACCESS_TITLE', '.htaccess & web.config Update', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1658, 'COM_CPANEL_MSG_HTACCESSSVG_TITLE', 'Additional XSS protection for the usage of SVG files', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1659, 'COM_CPANEL_MSG_HTACCESSSVG_BODY', '<p>Since 3.9.21 Joomla is shipped with an additional security rule in the default htaccess.txt. This rule will protect users of svg files from potential Cross-Site-Scripting (XSS) vulnerabilities.<br>The security team recommends to manually apply the necessary changes to any existing .htaccess file, as this file can not be updated automatically.</p><p><strong>Changes for .htaccess</strong></p><pre>&lt;FilesMatch \"\\.svg$\"&gt;\\n  &lt;IfModule mod_headers.c&gt;\\n    Header always set Content-Security-Policy \"script-src \'none\'\"\\n  &lt;/IfModule&gt;\\n&lt;/FilesMatch&gt;</pre><p>Currently we are not aware of a method to conditionally configure this on IIS web servers, please contact your hosting provider for further assistance.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1660, 'COM_CPANEL_MSG_JOOMLA40_PRE_CHECKS_TITLE', 'Prepare for the next Major Release of Joomla', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1661, 'COM_CPANEL_MSG_JOOMLA40_PRE_CHECKS_BODY', '<p>Beginning with Joomla! 4.0 we are raising the minimum server requirements. If you are seeing this message then your current configuration does not meet these new minimum requirements.</p><p>The <a href=\"https://developer.joomla.org/news/788-joomla-4-on-the-move.html\"><strong>minimum</strong> requirements</a> are the following:</p><ul><li>PHP 7.2.5</li><li>MySQL 5.6</li><li>MariaDB 10.1</li><li>PostgreSQL 11.0</li><li>MS SQL will <strong>not</strong> be supported</li><li>MySQL using the legacy `ext/mysql` PHP extension will <strong>not</strong> be supported, either the MySQLi or \"MySQL (PDO)\" driver must be used instead</li><li>PostgreSQL using the `ext/pgsql` PHP extension will <strong>not</strong> be supported, the \"PostgreSQL (PDO)\" driver must be used instead</li></ul><p>Please contact your hosting provider to ask how you can meet these raised server requirements - it is usually a very simple change. When you meet these new requirements then this message will no longer be displayed.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1662, 'COM_CPANEL_MSG_LANGUAGEACCESS340_TITLE', 'You have possible issues with your multilingual settings', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1663, 'COM_CPANEL_MSG_LANGUAGEACCESS340_BODY', 'Since Joomla! 3.4.0 you may have issues with the System - Language Filter plugin on your website. To fix them please open the <a href=\"index.php?option=com_languages&view=languages\">Language Manager</a> and save each content language manually to make sure an Access level is saved.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1664, 'COM_CPANEL_MSG_PHPVERSION_BODY', 'Beginning with Joomla! 3.3, the version of PHP this site is using will no longer be supported. Joomla! 3.3 will require at least <a href=\"https://community.joomla.org/blogs/leadership/1798-raising-the-bar-on-security.html\">PHP version 5.3.10 to provide enhanced security features to its users</a>.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1665, 'COM_CPANEL_MSG_PHPVERSION_TITLE', 'Your PHP Version Will Be Unsupported in Joomla! 3.3', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1666, 'COM_CPANEL_MSG_ROBOTS_TITLE', 'robots.txt Update', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1667, 'COM_CPANEL_MSG_ROBOTS_BODY', 'A change to the default robots.txt files was made in Joomla! 3.3 to allow Google to access templates and media files by default to improve SEO. This change is not applied automatically on upgrades and users are recommended to review the changes in the robots.txt.dist file and implement these changes in their own robots.txt file.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1668, 'COM_CPANEL_MSG_STATS_COLLECTION_BODY', '<p>Since Joomla! 3.5 a statistics plugin will submit anonymous data to the Joomla Project. This will only submit the Joomla version, PHP version, database engine and version, and server operating system.</p><p>This data is collected to ensure that future versions of Joomla can take advantage of the latest database and PHP features without affecting significant numbers of users. The need for this became clear when a minimum of PHP 5.3.10 was required when Joomla! 3.3 implemented the more secure Bcrypt passwords.</p><p>In the interest of full transparency and to help developers <a href=\"https://developer.joomla.org/about/stats.html\">this data is publicly available.</a> An API and graphs will show the Joomla version, PHP versions and database engines in use.</p><p>If you do not wish to provide the Joomla Project with this information you can disable the plugin called System - Joomla Statistics.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1669, 'COM_CPANEL_MSG_STATS_COLLECTION_TITLE', 'Stats Collection in Joomla', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1670, 'COM_CPANEL_MSG_TEXTFILTER3919_BODY', '<p>As part of our security team\'s review, we have made some changes to the default settings for the global text filters in a new Joomla installation. The default setting for the \'Public\', \'Guest\' and \'Registered\' groups is now \'No HTML\'. As these changes are only applied to new installations, we strongly recommend that you review these changes and update your site from: System -> Global Configuration -> Text Filters</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1671, 'COM_CPANEL_MSG_TEXTFILTER3919_TITLE', 'Updated Text Filter Recommendations', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1672, 'COM_CPANEL_MSG_UPDATEDEFAULTSETTINGS_BODY', '<p>As part of our security team\'s review, we have made some changes to the default settings in a new Joomla installation. As these changes are only applied to new installations, we strongly recommend that you review these changes and update your site.</p><p>The changed settings are:</p><ul><li>Global Configuration > Text Filters: The default \"Administrator\" user group has changed from \"No Filtering\" to \"Default Blacklist\"</li><li>Users > Send Password: The option to send a user their password in plain text when an account is created is now disabled by default</li><li>Media Manager: Flash files (\"swf\" file extension and \"application/x-shockwave-flash\" MIME Type) are not allowed to be uploaded</li><li>Articles > Show Email: The option to show an email icon with articles is disabled by default</li></ul><p>We have created a <a href=\"https://docs.joomla.org/Special:MyLanguage/J3.x:Joomla_3.8.8_notes_about_the_changed_default_settings\">dedicated documentation page</a> explaining these changes.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1673, 'COM_CPANEL_MSG_UPDATEDEFAULTSETTINGS_TITLE', 'Updated site security recommendations', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1674, 'COM_CPANEL_WELCOME_BEGINNERS_MESSAGE', '<p>Community resources are available for new users.</p><ul><li><a href=\"https://docs.joomla.org/Special:MyLanguage/Portal:Beginners\">Joomla! Beginners Guide</a></li><li><a href=\"https://forum.joomla.org/viewforum.php?f=706\">New to Joomla! Forum</a></li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
(1675, 'COM_CPANEL_WELCOME_BEGINNERS_TITLE', 'Welcome to Joomla!', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_cpanel.ini'),
