(2190, 'COM_INSTALLER_MSG_WARNINGS_FILEUPLOADISDISABLEDDESC', 'File uploads are required to upload extensions into the installer.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
