(2192, 'COM_INSTALLER_MSG_WARNINGS_JOOMLATMPNOTSET', 'The Joomla temporary folder is not set.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2193, 'COM_INSTALLER_MSG_WARNINGS_JOOMLATMPNOTSETDESC', 'The Joomla temporary folder is where Joomla copies an extension, extracts the extension and the files are copied into the correct directories. If this configuration is not set in configuration.php ($tmp_path) then you won\'t be able to upload extensions. Create a folder to enable Joomla to write to the folder to fix the issue.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2194, 'COM_INSTALLER_MSG_WARNINGS_JOOMLATMPNOTWRITEABLE', 'The Joomla temporary folder is not writable or does not exist.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2195, 'COM_INSTALLER_MSG_WARNINGS_JOOMLATMPNOTWRITEABLEDESC', 'The Joomla temporary folder is not writeable by the Joomla instance, or may not exist, which may cause issues when trying to upload extensions to Joomla. If you are having issues uploading extensions, make sure the folder defined in your configuration.php exists or check the \'%s\' and set it to be writeable and see if this fixes the issue.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2196, 'COM_INSTALLER_MSG_WARNINGS_LOWMEMORYDESC', 'Low PHP memory limit.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2197, 'COM_INSTALLER_MSG_WARNINGS_LOWMEMORYWARN', 'Your PHP memory limit is set below 8MB which may cause some issues when installing large extensions. Please set your memory limit to at least 16MB.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2198, 'COM_INSTALLER_MSG_WARNINGS_MEDMEMORYDESC', 'Potentially low PHP memory limit.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2199, 'COM_INSTALLER_MSG_WARNINGS_MEDMEMORYWARN', 'Your PHP memory limit is set below 16MB which may cause some issues when installing large extensions. Please set your memory limit to at least 16MB.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2200, 'COM_INSTALLER_MSG_WARNINGS_NONE', 'No warnings detected.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2201, 'COM_INSTALLER_MSG_WARNINGS_NOTCOMPLETE', '<h1>Warning: Update Not Complete!</h1><p>The update is only partially complete. Please do the second update to complete the process.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2202, 'COM_INSTALLER_MSG_WARNINGS_NOTICE', 'There are some warnings detected.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2203, 'COM_INSTALLER_MSG_WARNINGS_PHPUPLOADNOTSET', 'The PHP temporary folder is not set.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2204, 'COM_INSTALLER_MSG_WARNINGS_PHPUPLOADNOTSETDESC', 'The PHP temporary folder is the folder that PHP uses to store an uploaded file before Joomla can access this file. Whilst the folder not being set isn\'t always a problem, if you are having issues with manifest files not being detected or uploaded files not being detected, setting this in your php.ini file might fix the issue.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2205, 'COM_INSTALLER_MSG_WARNINGS_PHPUPLOADNOTWRITEABLE', 'The PHP temporary folder is not writeable.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2206, 'COM_INSTALLER_MSG_WARNINGS_PHPUPLOADNOTWRITEABLEDESC', 'The PHP temporary folder is not writeable by the Joomla! instance, which may cause issues when trying to upload extensions to Joomla. If you are having issues uploading extensions, check the \'%s\' and set it to be writeable and see if this fixes the issue.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2207, 'COM_INSTALLER_MSG_WARNINGS_SMALLPOSTSIZE', 'Small PHP maximum POST size.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2208, 'COM_INSTALLER_MSG_WARNINGS_SMALLPOSTSIZEDESC', 'The maximum POST size sets the most amount of data that can be sent via POST to the server. This includes form submissions for articles, media (images, videos) and packages. This value is less than 8MB which may impact on uploading large packages. This is set in the php.ini under post_max_size.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2209, 'COM_INSTALLER_MSG_WARNINGS_SMALLUPLOADSIZE', 'Maximum PHP file upload size is too small: This is set in php.ini in both upload_max_filesize and post_max_size settings of your PHP settings (located in php.ini and/or .htaccess file).', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2210, 'COM_INSTALLER_MSG_WARNINGS_SMALLUPLOADSIZEDESC', 'The maximum file size for uploads is set to less than 8MB which may impact on uploading large packages.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2211, 'COM_INSTALLER_MSG_WARNINGS_UPDATE_NOTICE', 'Before updating ensure that the update is compatible with your Joomla! installation. <br>You are strongly advised to make a <strong>backup</strong> of your site\'s files and database before you start updating.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2212, 'COM_INSTALLER_MSG_WARNINGS_UPLOADBIGGERTHANPOST', 'PHP Upload Size bigger than POST size.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2213, 'COM_INSTALLER_MSG_WARNINGS_UPLOADBIGGERTHANPOSTDESC', 'The value of the upload_max_filesize in the php.ini file is greater than the post_max_size variable. The post_max_size variable will take precedence and block requests larger than it. This is generally a server misconfiguration when trying to increase upload sizes. Please increase the upload_max_filesize to at least match the post_max_size variable or vice versa.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
(2214, 'COM_INSTALLER_MSG_WARNINGS_UPLOADFILETOOBIG', 'The selected file cannot be uploaded as it is bigger than the maximum upload size.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_installer.ini'),
