(2570, 'WF_PARAM_EDITOR_GLOBAL_CSS_DESC', 'CSS file to use for editor content styling and Styles list options<ul><li>Template CSS file - Use the default css file (template.css or template_css.css) of your Joomla! template</li><li>Custom CSS File - Use a custom CSS file specified in the <strong>Custom CSS File</strong> field</li><li>Default - Use default JCE Editor styles</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2571, 'WF_PARAM_EDITOR_PROFILE_CSS_DESC', 'Specify how to integrate the Custom CSS files and Custom Styles with the Editor Styles set in the Editor Global Configuration.<ul><li>Add - Add the <strong>Custom CSS Files</strong> to the Editor Styles. Add the <strong>Custom Styles</strong> to the Styles list.</li><li>Overwrite - Replace the Editor Styles with the <strong>Custom CSS Files</strong> and <strong>Custom Styles</strong>.</li><li>Inherit - Use the Editor Styles set in the Editor Global Configuration only (Default)</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2572, 'WF_PARAM_CSS_TEMPLATE', 'Template CSS File', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
