(2574, 'WF_PARAM_CSS_CUSTOM_DESC', 'Use a custom CSS file for styling the editor content and as a source for classes in the Styles list if <strong>Editor Styles</strong> is set to <strong>Custom CSS Files</strong><br />Enter the relative url of the replacement css file.<br />The $template variable will be replaced by your active template name.<br />separate multiple stylesheets with a comma, eg: templates/$template/css/sheet1.css,<br />templates/$template/css/sheet2.css<br />Clear your browser cache after changing the Editor Styles setting.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
