(2584, 'WF_PARAM_ROOT_BLOCK', 'Container Element & Enter Key', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2585, 'WF_PARAM_ROOT_BLOCK_DESC', 'Select Container Element and Enter Key behaviour :<ul><li><strong>Paragraph Container & Paragraph on Enter (Default)</strong><br />All Text and non-block elements will be wrapped in a Paragraph, and pressing the Enter key will create a new Paragraph. SHIFT+Enter creates a linebreak.</li><li><strong>Div Container & Div on Enter</strong><br />All Text and non-block elements will be wrapped in a DIV, and pressing the Enter key will create a new DIV. SHIFT+Enter creates a linebreak.</li><li><strong>No Container & Paragraph on Enter</strong><br />Text and non-block elements will not be wrapped. Pressing the Enter key will create a new Paragraph. SHIFT+Enter creates a linebreak.</li><li><strong>No Container & Linebreak on Enter</strong><br />Text and non-block elements will not be wrapped. Pressing the Enter key will create a linebreak. SHIFT+Enter creates a paragraph.</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
