(2654, 'WF_PARAM_ELEMENTS', 'Extended Elements', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2655, 'WF_PARAM_ELEMENTS_DESC', 'Extend functionality by adding in extra elements here, in the form element[attribute1&#124;attribute2], separated by a comma, eg: em[id&#124;title&#124;class],i[id&#124;title&#124;class]. Elements added here will be removed from the Prohibited Elements list.<br /><strong>Only applies if \'Cleanup HTML\' is \'Yes\'</strong>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2656, 'WF_PARAM_NO_ELEMENTS', 'Prohibited Elements', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2657, 'WF_PARAM_NO_ELEMENTS_DESC', 'Comma separated list of prohibited elements. For security purposes the following elements will always be removed unless an appropriate plugin or configuration setting is installed or enabled - applet, iframe, object, embed, script, style, body, bgsound, base, basefont, frame, frameset, head, html, id, ilayer, layer, link, meta, name, title, xml<br /><strong>Only applies if \'Cleanup HTML\' is \'Yes\'</strong>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2658, 'WF_PARAM_INVALID_ATTRIBUTES', 'Prohibited Attributes', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2659, 'WF_PARAM_INVALID_ATTRIBUTES_DESC', 'Comma separated list of prohibited attributes, eg: dynsrc,lowsrc. Can accept regular expression values, eg: on([a-z]+) will remove all event attributes (onclick, onmouseover etc.)<br /><strong>Only applies if \'Cleanup HTML\' is \'Yes\'</strong>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2660, 'WF_PARAM_INVALID_ATTRIBUTE_VALUES', 'Prohibited Attribute Values', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2661, 'WF_PARAM_INVALID_ATTRIBUTE_VALUES_DESC', 'Comma separated list of prohibited attribute values in the CSS Attribute Selector format, eg: img[title=\'test\'] will remove the title attribute value from all img tags with the value \'test\'.<br />Accepts the CSS 2.1 and CSS 3 Attribute Selectors - <ul><li>Attribute starts with value : tag[name^=\'value\']<br />eg: img[src=\'data:image\'] will remove all base64 encoded paths from img src attributes</li><li>Attribute equals value : tag[name=\'value\']</li><li>Attribute is not equal to value : name!=\'value\'</li><li>Attribute ends with value : tag[name$=\'value\']<br />eg: img[src$=\'.jpg\'] will remove all img src values that contain paths with the .jpg extension</li></ul><br /><strong>Only applies if \'Cleanup HTML\' is \'Yes\'</strong>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2662, 'WF_PARAM_PHP', 'Allow PHP', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2663, 'WF_PARAM_PHP_DESC', 'Allow PHP code in Code Blocks and the Code Editor. Full support may require an additional front-end content or system plugin to be installed.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2664, 'WF_PARAM_ENTITY_ENCODING', 'Entity Encoding', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2665, 'WF_PARAM_ENTITY_ENCODING_DESC', 'Entity encoding method to be used by the editor. ', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2666, 'WF_PARAM_PROTECT_SHORTCODE', 'Protect Shortcode', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2667, 'WF_PARAM_PROTECT_SHORTCODE_DESC', 'EXPERIMENTAL - Protect the contents of shortcode tags, eg: {tag}content{/tag} from processing by the editor', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2668, 'WF_PARAM_ALLOW_CUSTOM_XML', 'Allow Custom XML', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2669, 'WF_PARAM_ALLOW_CUSTOM_XML_DESC', 'Allow editing of custom XML code in Code Blocks and the Code Editor.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2670, 'WF_PARAM_CODE_BLOCKS', 'Code Blocks', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2671, 'WF_PARAM_CODE_BLOCKS_DESC_WARNING', '<strong>Caution:</strong> Enabling any of these options will allow users of the editor to create content and effect changes to the site - directly or indirectly - that could present a security risk to the site and its visitors. These options should therefore only be enabled in profiles assigned to trusted users and user groups.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2672, 'WF_PARAM_CODE_BLOCKS_ENABLE', 'Enable Code Blocks', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2673, 'WF_PARAM_CODE_BLOCKS_ENABLE_DESC', 'Display scripts and code in visible, editable Code Blocks in the editor. If disabled, placeholders will be used to indicate the presence of scripts in content, which must then be edited in the Code Editor.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2674, 'WF_PARAM_EDITOR_STYLE_RESET', 'High Contrast Mode', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2675, 'WF_PARAM_EDITOR_STYLE_RESET_DESC', 'Forces a high contrast styling of editor content with left aligned, black text on a white background. Set to Auto to detect whether this is neccessary based on the contrast of the background colour and body text colour.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2676, 'WF_PARAM_PAD_EMPTY_TAGS', 'Pad Empty Tags', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2677, 'WF_PARAM_PAD_EMPTY_TAGS_DESC', 'By default, some empty tags (p, h1-6, pre, div, address, caption) are padded with a non-breaking space so they maintain there structure when rendered by the browser. Without the space, some browsers would not render the tags correctly unless additional css is used.<br /><br />Set this option to <strong>No</strong> to remove the non-breaking space when the editor is toggled or the content is saved.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2678, 'WF_PARAM_VALIDATE_STYLES', 'Validate Styles', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2679, 'WF_PARAM_VALIDATE_STYLES_DESC', 'Allow only a valid CSS syntax for the style atttribute value on all elements.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2680, 'WF_PARAM_ALLOW_EVENT_ATTRIBUTES', 'Allow Event Attributes', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2681, 'WF_PARAM_ALLOW_EVENT_ATTRIBUTES_DESC', 'Allow event attributes, eg: onclick, onload etc. on all elements. As event attributes are able to execute javascript code, they should only be allowed for trusted users.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2682, 'WF_PARAM_CUSTOM_COLORS', 'Custom Colours', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2683, 'WF_PARAM_CUSTOM_COLORS_DESC', 'A comma separated list of colours to be used by the ColourPicker, in Hex format, eg: #ff0000.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2684, 'WF_PARAM_CUSTOM_CONFIG', 'Custom Configuration Variables', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2685, 'WF_PARAM_CUSTOM_CONFIG_DESC', 'Specify optional values to set or override editor configuration options.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2686, 'WF_PARAM_FONTS', 'Fonts', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2687, 'WF_PARAM_FONTS_NEW', 'Add new font...', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2688, 'WF_PARAM_FONTS_DESC', 'Fonts to include in the Font Famliy list.<br />Uncheck a font to remove it from the list, add a new font by clicking the \'Add new font\' button. Drag to re-order fonts.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
