(2690, 'WF_PARAM_FONT_SIZES_DESC', 'Comma separated list of font size values eg: 8pt,10pt,12pt,14pt,18pt,24pt,36pt', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
