(2693, 'WF_BLOCK_FORMAT_PREVIEW_STYLES', 'Show Format Preview', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2694, 'WF_BLOCK_FORMAT_PREVIEW_STYLES_DESC', 'Show a simple styled preview of each format item in the list using the site template styles.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2695, 'WF_PARAM_DOCTYPE', 'Doctype', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2696, 'WF_PARAM_DOCTYPE_DESC', 'Doctype to validate HTML with (if Validate HTML is set to Yes)<ul><li>HTML4 : Validate using the HTML4 Transitional specification</li><li>HTML5 : Validate using the HTML5 specification</li><li>Mixed : Validate using a combination of the HTML4 and HTML5 specification</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2697, 'WF_PARAM_DOCTYPE_MIXED', 'Mixed', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2698, 'WF_PARAM_EDITOR_PROFILE_DOCTYPE_DESC', 'Doctype to validate HTML with (if Validate HTML is set to Yes)<ul><li>HTML4 : Validate using the HTML4 Transitional specification</li><li>HTML5 : Validate using the HTML5 specification</li><li>Mixed : Validate using a combination of the HTML4 and HTML5 specification</li><li>Inherit : Use the Doctype set in the Global Configuration</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2699, 'WF_PARAM_INLINE_UPLOAD', 'Inline Upload', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
