(2710, 'WF_PARAM_UPLOAD_SUFFIX_DESC', 'A suffix to add to an uploaded file if the file already exists. The default value is \'_copy\'. Add a $ to the suffix to add a number increment, eg: _$, will yield _1, _2 etc.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
