(2712, 'WF_PARAM_UPLOAD_ADD_RANDOM_DESC', 'Append a 5 character random string to the name of uploaded files for added security.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2713, 'WF_PARAM_UPLOAD_REMOVE_EXIF', 'Remove Image EXIF data', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2714, 'WF_PARAM_UPLOAD_REMOVE_EXIF_DESC', 'Remove image <a href=\'https://en.wikipedia.org/wiki/Exchangeable_image_file_format\' title=\'EXIF\'>EXIF</a> data from uploaded JPEG and PNG files', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2715, 'WF_PARAM_UPLOAD_QUALITY', 'Upload Quality (%)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
