(2717, 'WF_PARAM_WEBSAFE_MODE', 'Websafe File Names', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2718, 'WF_PARAM_WEBSAFE_MODE_DESC', 'Format to use when creating websafe file and folder names. UTF-8 will allow full UTF-8 characters and A-Za-z0-9._-~ in the name, ASCII will convert some UTF-8 Latin characters into ASCII equivalents, eg: ë -> e, õ -> o etc. and will only allow A-Za-z0-9._-~ characters in the name.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2719, 'WF_PARAM_WEBSAFE_ALLOW_SPACES', 'Allow spaces in file/folder names', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2720, 'WF_PARAM_WEBSAFE_ALLOW_SPACES_DESC', 'Set to Yes to allow spaces in file and folder names or select a character to use as a replacement for the space.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2721, 'WF_PARAM_WEBSAFE_TEXTCASE', 'Text Case', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
