(2724, 'WF_PARAM_DATE_FORMAT_DESC', 'Date Format to use when displaying the Modified date of Files and Folders, eg: %d/%m/%Y, %H:%M will display as 13/12/1984, 14:00', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
