(2726, 'WF_PARAM_VALIDATE_MIMETYPE_DESC', 'For additional security when uploading, check the mimetype of the uploaded file against its extension. If enabled and the server does not support the PHP fileinfo or mime_content_type functions, the mimetype check will be skipped.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
