(2736, 'WF_PARAM_KEEP_NBSP_DESC', 'When Entity Encoding is set to UTF-8, convert UTF-8 spaces to non-breaking spaces (recommended)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
(2737, 'WF_PARAM_TOTAL_FILES_LIMIT', 'Total Files Limit', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_jce.ini'),
