(4061, 'COM_JOOMLAUPDATE_VIEW_DEFAULT_UPDATES_INFO_DEFAULT', 'You are on the &quot;%s&quot; update channel. Through this channel you\'ll receive notifications for all updates of the current Joomla release (3.x)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_joomlaupdate.ini'),
(4062, 'COM_JOOMLAUPDATE_VIEW_DEFAULT_UPDATES_INFO_NEXT', 'You are on the &quot;%s&quot; update channel. Through this channel you\'ll receive notifications for all updates of the current Joomla release (3.x) and you will also be notified when the future major release (4.x) will be available. Before upgrading to 4.x you\'ll need to assess its compatibility with your environment.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_joomlaupdate.ini'),
(4063, 'COM_JOOMLAUPDATE_VIEW_DEFAULT_UPDATES_INFO_TESTING', 'You are on the &quot;%s&quot; update channel. This channel is designed for testing new releases and fixes in Joomla.<br />It is only intended for JBS (Joomla Bug Squad&trade;) members and others within the Joomla community who are testing. Do not use this setting on a production site.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_joomlaupdate.ini'),
(4064, 'COM_JOOMLAUPDATE_VIEW_DEFAULT_UPDATE_NOTICE', 'Before you update Joomla, ensure that the installed extensions are available for the new Joomla version. <br>You are strongly advised to make a <strong>backup</strong> of your site\'s files and database before you start updating.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_joomlaupdate.ini'),
(4065, 'COM_JOOMLAUPDATE_VIEW_DEFAULT_UPLOAD_INTRO', 'You can use this feature to update Joomla if your server is behind a firewall or otherwise unable to contact the update servers. First download the Joomla <em>Upgrade Package</em> in ZIP format from <a class=\"alert-link\" href=\"%s\">the official Joomla download page</a>. Then use the fields below to upload and install it.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_joomlaupdate.ini'),
