(5168, 'COM_PRIVACY_CORE_CAPABILITY_COMMUNICATION_WITH_JOOMLA_ORG', 'When a network connection is available, a Joomla installation will attempt to communicate with the joomla.org servers for various capabilities, to include:<ul><li>Checking for updates for the Joomla application</li><li>Help screens for core Joomla extensions</li><li>The Install from Web service (opt-in)</li><li>The statistics collection server (opt-in)</li></ul>As with all HTTP requests, the IP address of your server will be transmitted as part of the request. For information on how Joomla processes data on its servers, please review our <a href=\"https://www.joomla.org/privacy-policy.html\" target=\"_blank\" rel=\"noopener noreferrer\">privacy policy</a>.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
(5169, 'COM_PRIVACY_CORE_CAPABILITY_LOGGING_IP_ADDRESS', 'Joomla\'s logging system records the IP address of the visitor which leads to a message being written to its log files. These log files are used to record various activity on a Joomla site, including information related to core updates, invalid login attempts, unhandled errors, and development information such as the use of deprecated APIs. The format of these log files may be customised by any extension which configures a logger, therefore you are encouraged to download and review the log files for your website which may be found at `%s`.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
(5170, 'COM_PRIVACY_CORE_CAPABILITY_SESSION_IP_ADDRESS_AND_COOKIE', 'All requests to a Joomla website start a session which stores the IP address in the session data and creates a session cookie in the user\'s browser. The IP address is used as a security measure to help protect against potential session hijacking attacks and this information is deleted once the session has expired and its data purged. The session cookie\'s name is based on a randomly generated hash and therefore does not have a constant identifier. The session cookie is destroyed once the session has expired or the user has exited their browser.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
