(5189, 'COM_PRIVACY_EXTENSION_CAPABILITY_PERSONAL_INFO', 'In order to process information requests, information about the user must be collected and logged for the purposes of retaining an audit log. The request system is based on an individual\'s email address which will be used to link the request to an existing site user if able.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
(5190, 'COM_PRIVACY_EMAIL_ADMIN_REQUEST_BODY_EXPORT_REQUEST', 'An administrator for [URL] has created a request to export personal information related to this email address. As a security measure, you must confirm that this is a valid request for your personal information from this website.\\n\\nIf this was a mistake, just ignore this email and nothing will happen.\\n\\nIn order to confirm this request, you can complete one of the following tasks:\\n\\n1. Visit the following URL: [TOKENURL]\\n\\n2. Copy your token from this email, visit the referenced URL, and paste your token into the form.\\nURL: [FORMURL]\\nToken: [TOKEN]\\n\\nPlease note that this token is only valid for 24 hours from the time this email was sent.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
(5191, 'COM_PRIVACY_EMAIL_ADMIN_REQUEST_BODY_REMOVE_REQUEST', 'An administrator for [URL] has created a request to remove all personal information related to this email address. As a security measure, you must confirm that this is a valid request for your personal information to be removed from this website.\\n\\nIf this was a mistake, just ignore this email and nothing will happen.\\n\\nIn order to confirm this request, you can complete one of the following tasks:\\n\\n1. Visit the following URL: [TOKENURL]\\n\\n2. Copy your token from this email, visit the referenced URL, and paste your token into the form.\\nURL: [FORMURL]\\nToken: [TOKEN]\\n\\nPlease note that this token is only valid for 24 hours from the time this email was sent.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
