(5246, 'COM_PRIVACY_MSG_CAPABILITIES_INTRODUCTION', 'The information on this screen is collected from extensions which report their privacy related capabilities to this system. It is intended to help site owners be aware of the capabilities of installed extensions and provide information to help owners create local site policies such as a privacy policy. As this screen requires extensions to support its reporting system, and only displays information from enabled extensions, this should not be considered a complete list and you are encouraged to consult each extension\'s documentation for more information.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
