(5258, 'COM_PRIVACY_POSTINSTALL_BODY', '<p>With the introduction of GDPR for EU citizens and similar regulations elsewhere in the world it may be necessary for you to request consent before storing any <strong>Personal Information</strong> of a user.</p><p>Joomla 3.9 introduces new capabilities to assist you in creating site privacy policies and collecting user consent. In addition a workflow is available to help you manage user information requests such as requests for removing their personal data from your site.</p><p>For further information on this new feature read the <a href=\'https://docs.joomla.org/J3.x:Privacy\' target=\'_new\'>Privacy documentation</a>.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.com_privacy.ini'),
