(6994, 'JGLOBAL_FILTER_TYPE_DESC', '1. Blacklist allows all tags and attributes except for those in the blacklist.<br /><strong>--</strong> Tags for the Default Blacklist include: \'applet\', \'body\', \'bgsound\', \'base\', \'basefont\', \'canvas\', \'embed\', \'frame\', \'frameset\', \'head\', \'html\', \'id\', \'iframe\', \'ilayer\', \'layer\', \'link\', \'meta\', \'name\', \'object\', \'script\', \'style\', \'title\', \'xml\'<br /><strong>--</strong> Attributes for the Default Blacklist include: \'action\', \'background\', \'codebase\', \'dynsrc\', \'lowsrc\', \'formaction\'<br /><strong>--</strong> You can blacklist additional tags and attributes by adding to the Filter Tags and Filter Attributes fields, separating each tag or attribute name with a comma.<br /><strong>--</strong> Custom Blacklist allows you to override the Default Blacklist. Add the tags and attributes to be blacklisted in the Filter Tags and Filter Attributes fields.</p><p>Whitelist allows only the tags listed in the Filter Tags and Filter Attributes fields.</p><p>No HTML removes all HTML tags from the content when it is saved.</p><p>Please note that these settings work regardless of the editor that you are using. <br />Even if you are using a WYSIWYG editor, the filtering settings may strip additional tags and attributes prior to saving information in the database.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.ini'),
