(9710, 'PLG_QUICKICON_EOS310_MESSAGE_ERROR_SUPPORT_ENDED', '<p>Support has ended for your version of Joomla 3.10. <a href=\"%2$s\" target=\"_blank\" rel=\"noopener noreferrer\">Migrate to Joomla 4</a> <span class=\"icon-new-tab\"></span>as soon as possible.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_quickicon_eos310.ini'),
