(9712, 'PLG_QUICKICON_EOS310_MESSAGE_INFO_01', '<p>Joomla 4 has arrived! Find out all that Joomla 4 has to offer you. Check the landing page for <a href=\"%2$s\" target=\"_blank\" rel=\"noopener noreferrer\">Joomla 4 features</a> <span class=\"icon-new-tab\"></span>and improvements.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_quickicon_eos310.ini'),
