(9714, 'PLG_QUICKICON_EOS310_MESSAGE_INFO_02', '<p>When is the time to migrate to Joomla 4? Once the extensions your site needs are compatible. Learn <a href=\"%2$s\" target=\"_blank\" rel=\"noopener noreferrer\">how to use the Pre-Update Checker</a>. <span class=\"icon-new-tab\"></span></p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_quickicon_eos310.ini'),
