(9716, 'PLG_QUICKICON_EOS310_MESSAGE_WARNING_SECURITY_ONLY', '<p>Joomla 3.10 has entered security only mode. Support ends %1$s. Start <a href=\"%2$s\" target=\"_blank\" rel=\"noopener noreferrer\">planning to migrate</a> <span class=\"icon-new-tab\"></span>to Joomla 4 today.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_quickicon_eos310.ini'),
