(9772, 'PLG_SAMPLEDATA_BLOG', 'Sample Data - Blog', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9773, 'PLG_SAMPLEDATA_BLOG_OVERVIEW_DESC', 'Sample data which will set up a blog site.<br>If the site is multilingual, the data will be tagged to the active backend language.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9774, 'PLG_SAMPLEDATA_BLOG_OVERVIEW_TITLE', 'Blog Sample data', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9775, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_0_FULLTEXT', '', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9776, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_0_INTROTEXT', '<p>This tells you a bit about this blog and the person who writes it. </p><p>When you are logged in you will be able to edit this page by selecting the edit icon.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9777, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_0_TITLE', 'About', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9778, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_1_FULLTEXT', '', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9779, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_1_INTROTEXT', '<p>Here are some basic tips for working on your site.</p><ul><li>Joomla! has a \'front end\' that you are looking at now and an \'administrator\' or \'back end\' which is where you do the more advanced work of creating your site such as setting up the menus and deciding what modules to show. You need to login to the administrator separately using the same user name and password that you used to login to this part of the site.</li><li>One of the first things you will probably want to do is change the site title and tag line and to add a logo. To do this select the Template Settings link in the top menu. To change your site description, browser title, default email and other items, select Site Settings. More advanced configuration options are available in the administrator.</li><li>To totally change the look of your site you will probably want to install a new template. In the Extensions menu select Extensions Manager and then go to the Install tab. There are many free and commercial templates available for Joomla.</li><li>As you have already seen, you can control who can see different parts of you site. When you work with modules, articles or weblinks setting the Access level to Registered will mean that only logged in users can see them</li><li>When you create a new article or other kind of content you also can save it as Published or Unpublished. If it is Unpublished site visitors will not be able to see it but you will.</li><li>You can learn much more about working with Joomla from the <a href=\'https://docs.joomla.org/\'>Joomla documentation site</a> and get help from other users at the <a href=\'https://forum.joomla.org/\'>Joomla forums</a>. In the administrator there are help buttons on every page that provide detailed information about the functions on that page.</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9780, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_1_TITLE', 'Working on Your Site', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9781, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_2_FULLTEXT', '', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9782, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_2_INTROTEXT', '<p>This is a sample blog posting.</p><p>If you log in to the site (the Author Login link is on the very bottom of this page) you will be able to edit it and all of the other existing articles. You will also be able to create a new article and make other changes to the site.</p><p>As you add and modify articles you will see how your site changes and also how you can customise it in various ways.</p><p>Go ahead, you can\'t break it.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9783, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_2_TITLE', 'Welcome to your blog', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9784, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_3_FULLTEXT', '<p>On the full page you will see both the introductory content and the rest of the article. You can change the settings to hide the introduction if you want.</p><p></p><p></p><p></p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9785, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_3_INTROTEXT', '<p>Your home page is set to display the four most recent articles from the blog category in a column. Then there are links to the next two oldest articles. You can change those numbers by editing the content options settings in the blog tab in your site administrator. There is a link to your site administrator in the top menu.</p><p>If you want to have your blog post broken into two parts, an introduction and then a full length separate page, use the Read More button to insert a break.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9786, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_3_TITLE', 'About your home page', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9787, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_4_FULLTEXT', '', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9788, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_4_INTROTEXT', '<p>Your site has some commonly used modules already preconfigured. These include:</p><ul><li>Image Module which holds the image beneath the menu. This is a Custom module that you can edit to change the image.</li><li>Most Read Posts which lists articles based on the number of times they have been read.</li><li>Older Articles which lists out articles by month.</li><li>Syndicate which allows your readers to read your posts in a news reader.</li><li>Popular Tags, which will appear if you use tagging on your articles. Enter a tag in the Tags field when editing.</li></ul><p>Each of these modules has many options which you can experiment with in the Module Manager in your site Administrator. Moving your mouse over a module and selecting the edit icon will take you to an edit screen for that module. Always be sure to save and close any module you edit.</p><p>Joomla! also includes many other modules you can incorporate in your site. As you develop your site you may want to add more module that you can find at the <a href=\'https://extensions.joomla.org/\'>Joomla Extensions Directory.</a></p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9789, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_4_TITLE', 'Your Modules', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9790, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_5_FULLTEXT', '', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9791, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_5_INTROTEXT', '<p>Templates control the look and feel of your website.</p><p>This blog is installed with the Protostar template.</p><p>You can edit the options by selecting the Working on Your Site, Template Settings link in the top menu (visible when you login).</p><p>For example you can change the site background color, highlights color, site title, site description and title font used.</p><p>More options are available in the site administrator. You may also install a new template using the extension manager.</p>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9792, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_ARTICLE_5_TITLE', 'Your Template', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
(9793, 'PLG_SAMPLEDATA_BLOG_SAMPLEDATA_CONTENT_CATEGORY_0_TITLE', 'Blog', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_sampledata_blog.ini'),
