(10199, 'PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_DESC', 'A comma separated list of the email addresses which will receive the update notification emails. The addresses in the list MUST belong to existing users of your site who have the Super User privilege. If none of the listed emails belongs to Super Users, or if it\'s left blank, all Super Users of this site will receive the update notification email.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10200, 'PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_SUBJECT', 'Joomla! Update available for [SITENAME] – [URL]', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10201, 'PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_BODY', 'This email IS NOT sent by the Joomla! project. It is sent automatically by your own site,\\n[SITENAME] - [URL] \\n\\n================================================================================\\nUPDATE INFORMATION\\n================================================================================\\n\\nYour site has discovered that there is an updated version of Joomla! available for download.\\n\\nJoomla! version currently installed:        [CURVERSION]\\nJoomla! version available for installation: [NEWVERSION]\\n\\nThis email is sent to you by your site to remind you of this fact.\\nThe Joomla! project will never contact you directly about available updates of Joomla! on your site.\\n\\n================================================================================\\nUPDATE INSTRUCTIONS\\n================================================================================\\n\\nTo install the update on [SITENAME] please select the following link. (If the URL is not a link, copy & paste it to your browser).\\n\\nUpdate link: [LINK]\\n\\nRelease News can be found here: [RELEASENEWS]\\n\\n================================================================================\\nWHY AM I RECEIVING THIS EMAIL?\\n================================================================================\\n\\nThis email has been automatically sent by a plugin provided by Joomla!, the software which powers your site.\\nThis plugin looks for updated versions of Joomla! and sends an email notification to its administrators.\\nYou will receive several similar emails from your site until you either update the software or disable these emails.\\n\\nTo disable these emails, please unpublish the \'System - Joomla! Update Notification\' plugin in the Plugin Manager on your site.\\n\\nIf you do not understand what Joomla! is and what you need to do please do not contact the Joomla! project.\\nThey are NOT sending you this email and they cannot help you. Instead, please contact the person who built or manages your site.\\n\\nIf you are the person who built or manages your website, please note that this plugin may have been activated automatically when you installed or updated Joomla! on your site.\\n\\n================================================================================\\nWHO SENT ME THIS EMAIL?\\n================================================================================\\n\\nThis email is sent to you by your own site, [SITENAME]', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10202, 'PLG_SYSTEM_UPDATENOTIFICATION_LANGUAGE_OVERRIDE_LBL', 'Email Language', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10203, 'PLG_SYSTEM_UPDATENOTIFICATION_LANGUAGE_OVERRIDE_DESC', 'Select a language for the update notification emails. Set to Auto to send them in the site language at the time.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10204, 'PLG_SYSTEM_UPDATENOTIFICATION_LANGUAGE_OVERRIDE_NONE', 'Auto', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10205, 'PLG_SYSTEM_UPDATENOTIFICATION_POSTINSTALL_UPDATECACHETIME', 'The Joomla! Update Notification will not run in this configuration', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10206, 'PLG_SYSTEM_UPDATENOTIFICATION_POSTINSTALL_UPDATECACHETIME_BODY', 'In your Installer Configuration you have set the Option Update Cache (in Hours) to 0 this means that Joomla is not caching the Update. This means an email should be sent on every page visit but this is not possible. Please increase the value (6 is default) or confirm that the Joomla! Update Notification will never send you mails.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10207, 'PLG_SYSTEM_UPDATENOTIFICATION_POSTINSTALL_UPDATECACHETIME_ACTION', 'Set it back to the default setting (6 Hours)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10208, 'PLG_SYSTEM_UPDATENOTIFICATION_XML_DESCRIPTION', 'This plugin periodically checks for the availability of new Joomla! versions. When one is found it will send you an email, reminding you to update Joomla!. Pro Tip: You can customise the email message by overriding the language string keys PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_SUBJECT and PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_BODY.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.ini'),
(10209, 'PLG_SYSTEM_UPDATENOTIFICATION', 'System - Joomla! Update Notification', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.sys.ini'),
(10210, 'PLG_SYSTEM_UPDATENOTIFICATION_XML_DESCRIPTION', 'This plugin periodically checks for the availability of new Joomla! versions. When one is found it will send you an email, reminding you to update Joomla!. Pro Tip: You can customise the email message by overriding the language string keys PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_SUBJECT and PLG_SYSTEM_UPDATENOTIFICATION_EMAIL_BODY.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_updatenotification.sys.ini'),
