(10213, 'PLG_SYSTEM_WEBLINKS_XML_DESCRIPTION', 'This plugin returns statistical information about Joomla! Web Links.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_system_weblinks.ini'),
