(10216, 'PLG_TWOFACTORAUTH_TOTP', 'Two Factor Authentication - Google Authenticator', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10217, 'PLG_TWOFACTORAUTH_TOTP_ERR_VALIDATIONFAILED', 'You did not enter a valid security code. Please check your Google Authenticator setup and make sure that the time on your device matches the time on the site.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10218, 'PLG_TWOFACTORAUTH_TOTP_INTRO', 'This feature allows you to use Google Authenticator, or a compatible application such as FreeOTP, for two factor authentication. In addition to your username and password you will also need to provide a six digit security code to be able to login to this site. The security code is rotated every 30 seconds. This provides extra protection against hackers logging in to your account even if they were able to get hold of your password.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10219, 'PLG_TWOFACTORAUTH_TOTP_METHOD_TITLE', 'Google Authenticator', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10220, 'PLG_TWOFACTORAUTH_TOTP_POSTINSTALL_TITLE', 'Two Factor Authentication is Available', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10221, 'PLG_TWOFACTORAUTH_TOTP_POSTINSTALL_BODY', '<p>Joomla! comes with a built-in two factor authentication system. It secures your site login with a secondary secret code that\'s changing every 30 seconds. You can use your mobile device and the <a href=\"https://en.wikipedia.org/wiki/Google_Authenticator\" target=\"_blank\">Google Authenticator</a> app to produce that code.</p><p>By selecting the button below:</p><ul><li>Joomla! will enable the two factor authentication plugins</li><li>Two Factor Authentication is going to be available for all users.</li><li>Each user can configure Two Factor Authentication in User Details.</li><li>You can always disable Two Factor Authentication plugin, or configure it for Backend usage only.</li><li>You will be taken to your user profile page where you can find more information on two factor authentication and enable it for your user account.</li></ul>', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10222, 'PLG_TWOFACTORAUTH_TOTP_POSTINSTALL_ACTION', 'Enable two factor authentication', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10223, 'PLG_TWOFACTORAUTH_TOTP_SECTION_ADMIN', 'Administrator (Backend)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10224, 'PLG_TWOFACTORAUTH_TOTP_SECTION_BOTH', 'Both', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10225, 'PLG_TWOFACTORAUTH_TOTP_SECTION_DESC', 'In which sections of your site do you want to enable two factor authentication?', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10226, 'PLG_TWOFACTORAUTH_TOTP_SECTION_LABEL', 'Site Section', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10227, 'PLG_TWOFACTORAUTH_TOTP_SECTION_SITE', 'Site (Frontend)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10228, 'PLG_TWOFACTORAUTH_TOTP_STEP1_HEAD', 'Step 1 - Get Google Authenticator', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10229, 'PLG_TWOFACTORAUTH_TOTP_STEP1_ITEM1', 'Official Google Authenticator app for Android, iOS and BlackBerry', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10230, 'PLG_TWOFACTORAUTH_TOTP_STEP1_ITEM1_LINK', 'https://support.google.com/accounts/bin/answer.py?hl=en&answer=1066447', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10231, 'PLG_TWOFACTORAUTH_TOTP_STEP1_ITEM2', 'Compatible clients for other devices and operating system (listed in Wikipedia).', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10232, 'PLG_TWOFACTORAUTH_TOTP_STEP1_ITEM2_LINK', 'https://en.wikipedia.org/wiki/Google_Authenticator#Implementation', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10233, 'PLG_TWOFACTORAUTH_TOTP_STEP1_TEXT', 'Download and install <a href=\"https://en.wikipedia.org/wiki/Google_Authenticator\" target=\"_blank\">Google Authenticator</a>, or a compatible application such as <a href=\"https://freeotp.github.io/\" target=\"_blank\">FreeOTP</a>, on your smartphone or desktop. Use one of the following:', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10234, 'PLG_TWOFACTORAUTH_TOTP_STEP1_WARN', 'Please remember to sync your device\'s clock with a time-server. Time drift in your device may cause an inability to log in to your site.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10235, 'PLG_TWOFACTORAUTH_TOTP_STEP2_ACCOUNT', 'Account', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10236, 'PLG_TWOFACTORAUTH_TOTP_STEP2_ALTTEXT', 'Alternatively, you can scan the following QR code in Google Authenticator.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10237, 'PLG_TWOFACTORAUTH_TOTP_STEP2_HEAD', 'Step 2 - Set up', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10238, 'PLG_TWOFACTORAUTH_TOTP_STEP2_KEY', 'Key', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10239, 'PLG_TWOFACTORAUTH_TOTP_STEP2_RESET', 'If you want to change the key, disable the two factor authentication. When you try enabling it again it will generate a new key.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10240, 'PLG_TWOFACTORAUTH_TOTP_STEP2_TEXT', 'You will need to enter the following information to Google Authenticator or a compatible app.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10241, 'PLG_TWOFACTORAUTH_TOTP_STEP3_HEAD', 'Step 3 - Activate Two Factor Authentication', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10242, 'PLG_TWOFACTORAUTH_TOTP_STEP3_SECURITYCODE', 'Security Code', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10243, 'PLG_TWOFACTORAUTH_TOTP_STEP3_TEXT', 'To verify that everything is set up properly, please enter the security code displayed in Google Authenticator in the field below. Afterwards, please save your user profile. If the code is correct, the Two Factor Authentication feature will be enabled.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10244, 'PLG_TWOFACTORAUTH_TOTP_XML_DESCRIPTION', 'Allows users on your site to use two factor authentication using <a href=\"https://en.wikipedia.org/wiki/Google_Authenticator\" target=\"_blank\">Google Authenticator</a> or other compatible time-based One Time Password generators such as <a href=\"https://freeotp.github.io/\" target=\"_blank\">FreeOTP</a>. To use two factor authentication please edit the user profile and enable two factor authentication.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.ini'),
(10245, 'PLG_TWOFACTORAUTH_TOTP', 'Two Factor Authentication - Google Authenticator', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.sys.ini'),
(10246, 'PLG_TWOFACTORAUTH_TOTP_XML_DESCRIPTION', 'Allows users on your site to use two factor authentication using <a href=\"https://en.wikipedia.org/wiki/Google_Authenticator\" target=\"_blank\">Google Authenticator</a> or other compatible time-based One Time Password generators such as <a href=\"https://freeotp.github.io/\" target=\"_blank\">FreeOTP</a>. To use two factor authentication please edit the user profile and enable two factor authentication.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_totp.sys.ini'),
(10247, 'PLG_TWOFACTORAUTH_YUBIKEY', 'Two Factor Authentication - YubiKey', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10248, 'PLG_TWOFACTORAUTH_YUBIKEY_ERR_VALIDATIONFAILED', 'You did not enter a valid YubiKey secret code or the YubiCloud servers are unreachable at this time.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10249, 'PLG_TWOFACTORAUTH_YUBIKEY_INTRO', 'This feature allows you to use a YubiKey secure hardware token for two factor authentication. In addition to your username and password you will also need to insert your YubiKey into your computer\'s USB port, select inside the Secret Key area of the site\'s login area and touch YubiKey\'s gold disk. The secret code generated by your YubiKey is unique to your device and changes constantly. This provides extra protection against hackers logging in to your account even if they were able to get hold of your password.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10250, 'PLG_TWOFACTORAUTH_YUBIKEY_METHOD_TITLE', 'YubiKey', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10251, 'PLG_TWOFACTORAUTH_TOTP_RESET_HEAD', 'Your YubiKey is already linked to your user account.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10252, 'PLG_TWOFACTORAUTH_TOTP_RESET_TEXT', 'Your YubiKey is already linked to your user account. If you want to unlink your YubiKey from your user account or use another YubiKey, please first disable two factor authentication and save your user profile. Then come back to this user profile page and re-activate two factor authentication with the YubiKey method.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10253, 'PLG_TWOFACTORAUTH_YUBIKEY_SECTION_ADMIN', 'Administrator (Backend)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10254, 'PLG_TWOFACTORAUTH_YUBIKEY_SECTION_BOTH', 'Both', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10255, 'PLG_TWOFACTORAUTH_YUBIKEY_SECTION_DESC', 'In which sections of your site do you want to enable two factor authentication?', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10256, 'PLG_TWOFACTORAUTH_YUBIKEY_SECTION_LABEL', 'Site Section', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10257, 'PLG_TWOFACTORAUTH_YUBIKEY_SECTION_SITE', 'Site (Frontend)', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10258, 'PLG_TWOFACTORAUTH_YUBIKEY_SECURITYCODE', 'Security Code', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10259, 'PLG_TWOFACTORAUTH_YUBIKEY_STEP1_HEAD', 'Set up', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10260, 'PLG_TWOFACTORAUTH_YUBIKEY_STEP1_TEXT', 'Please insert your YubiKey device into your computer\'s USB port. Select the Security Code field below. Then touch the gold disk on your YubiKey device for one second. Afterwards, please save your user profile. If the code generated by your YubiKey is validated by YubiCloud the Two Factor Authentication feature will be enabled and this YubiKey will be linked with your user account.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10261, 'PLG_TWOFACTORAUTH_YUBIKEY_XML_DESCRIPTION', 'Allows users on your site to use two factor authentication using a YubiKey secure hardware token. Users need their own Yubikey available from https://www.yubico.com/. To use two factor authentication users have to edit their user profile and enable two factor authentication.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.ini'),
(10262, 'PLG_TWOFACTORAUTH_YUBIKEY', 'Two Factor Authentication - YubiKey', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.sys.ini'),
(10263, 'PLG_TWOFACTORAUTH_YUBIKEY_XML_DESCRIPTION', 'Allows users on your site to use two factor authentication using a YubiKey secure hardware token. Users need their own Yubikey available from https://www.yubico.com/. To use two factor authentication users have to edit their user profile and enable two factor authentication.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_twofactorauth_yubikey.sys.ini'),
(10264, 'PLG_CONTACTCREATOR_ERR_FAILED_CREATING_CONTACT', 'Automatic contact creation failed. Please contact a site administrator.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_user_contactcreator.ini'),
