(10266, 'PLG_CONTACTCREATOR_FIELD_AUTOMATIC_WEBPAGE_DESC', 'A formatted string to automatically generate a contact\'s web page. [name] is replaced with the name, [username] is replaced with the username, [userid] is replaced with the user ID and [email] is replaced with the email.', '/Users/damian/Sites/2-birdie-place/administrator/language/en-GB/en-GB.plg_user_contactcreator.ini'),
