(10615, 'SCSS_COMPILER_XML_DESC', '<img style=\'float:left;\' src=\'//lomart.fr/lomart.png\'><div style=\'padding-left:120px;\'><p>SCSS COMPILER compiles all files (.SCSS) in folder SCSS for the active template on .CSS files with the same name in the active template CSS folder.</p><p>It uses the script scssphp by <a href=//leafo.net/scssphp/>leafo.net</a></p><p>Documentation on website <a href=\'//lomart.fr/extensions/scss-compiler\'>LOMART.FR</a></p><p>Do not forget to <a href=\'index.php?option=com_plugins\'>activate the plugin</a></p></div>', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/en-GB/en-GB.plg_system_scsscompiler.sys.ini'),
(10616, 'SCSS_COMPILER', 'System - SCSS Compiler', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/fr-FR/fr-FR.plg_system_scsscompiler.ini'),
(10617, 'SCSS_COMPILER_XML_DESC', '<p style=\'text-align:left;\'>Le plugin <b>SCSS COMPILER</b> compile tous les fichiers .SCSS du dossier SCSS pour le template actif en fichiers .CSS de même nom dans le dossier CSS du template actif.</p><p>Il peut aussi prendre en charge d\'autres dossiers</p><p>Il utilise le script scssphp (version 1.8.1) de <a href=\'//leafo.net/scssphp/\'>leafo.net</a> - Documentation sur <a href=\'//lomart.fr/extensions/scss-compiler\'>lomart.fr</a>', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/fr-FR/fr-FR.plg_system_scsscompiler.ini'),
(10618, 'SCSS_COMPILER_MSGOK_LABEL', 'Message réussite', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/fr-FR/fr-FR.plg_system_scsscompiler.ini'),
(10619, 'SCSS_COMPILER_MSGOK_DESC', 'Oui affiche un message lors d\'une compilation réussie pour signaler que le plugin est actif. Il est conseillé de désactiver le plugin sur un site en production.', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/fr-FR/fr-FR.plg_system_scsscompiler.ini'),
