(10621, 'SCSS_COMPILER_FORCE_DESC', 'Pour gagner du temps, les sous-dossiers ne sont pas analysés. Dans le cas d\'une modification d\'un partiel SCSS d\'un sous-dossier, il faut forcer la compilation (ou modifier légèrement un des fichiers impliqués dans le dossier racine).', '/Users/damian/Sites/2-birdie-place/plugins/system/scsscompiler/language/fr-FR/fr-FR.plg_system_scsscompiler.ini'),
